TS.raw_templates['notifications_items'] = "{{i18n_ns \"menu_notifications_items\"}}\n{{#if in_dnd}}\n\t<li><a class=\"overflow_ellipsis\" data-dnd-menu-action=\"turn_off\">{{#t}}Turn OFF{{\/t}}<\/a><\/li>\n{{else}}\n\t<div class=\"section_header\"><hr><span class=\"header_label menu_mini\">{{#t note=\"Heading for a list of durations (e.g., 2 hours)\"}}Snooze notifications:{{\/t}}<\/span><\/div>\n\t{{> snooze_items}}\n\t<li class=\"divider\"><\/li>\n{{\/if}}\n\n{{#if is_snoozing}}\n\t<li id=\"adjust_snooze_time\" class=\"has_submenu\" role=\"menuitem\"><a class=\"overflow_ellipsis\">{{#t}}Adjust time <ts-icon class=\"ts_icon_caret_right submenu_caret\"><\/ts-icon>{{\/t}}<\/a><\/li>\n{{else}}\n\t{{#if in_dnd}}\n\t\t<li id=\"adjust_dnd_schedule\" role=\"menuitem\"><a class=\"overflow_ellipsis\" data-dnd-menu-action=\"dnd_schedule\" aria-haspopup=\"true\">{{#t}}Adjust schedule &hellip;{{\/t}}<\/a><\/li>\n\t{{else}}\n\t\t<li id=\"adjust_dnd_schedule\" role=\"menuitem\"><a class=\"overflow_ellipsis\" data-dnd-menu-action=\"dnd_schedule\">{{#t}}Do Not Disturb schedule &hellip;{{\/t}}<\/a><\/li>\n\t{{\/if}}\n{{\/if}}\n\n<li class=\"divider\"><\/li>\n\n{{#feature flag=\"feature_focus_mode\"}}\n\t<li>\n\t\t<a data-dnd-menu-action=\"enter_focus_mode\">\n\t\t\t<div class=\"display_flex justify_content_between\">\n\t\t\t\t<span>{{#t}}Turn on Focus Mode{{\/t}}<\/span>\n\t\t\t\t<span class=\"tiny\">{{cmd_key}}+{{meta_key}}+f<\/span>\n\t\t\t<\/div>\n\t\t<\/a>\n\t<\/li>\n\t<li class=\"divider\"><\/li>\n{{\/feature}}\n\n{{#unless model_ob.is_im}}\n\t<li id=\"channel_notification_settings\" class=\"overflow_ellipsis\" role=\"menuitem\">\n\t\t<a class=\"overflow_ellipsis\" data-dnd-menu-action=\"channel_settings\">{{#t name=model_ob_name note=\"{name} is the title of a channel, group, or mpim\"}}Settings for <strong>{name}<\/strong> &hellip;{{\/t}}<\/a>\n\t<\/li>\n{{\/unless}}\n\n<li id=\"notification_settings\" class=\"overflow_ellipsis\" role=\"menuitem\"><a class=\"overflow_ellipsis\" data-dnd-menu-action=\"notif_prefs\">{{#t}}Your notification preferences &hellip;{{\/t}}<\/a><\/li>\n";
TS.raw_templates['snooze_items'] = "{{i18n_ns \"menu_snooze_items\"}}\n<li role=\"menuitem\"><a data-snooze-length=\"20\"   data-dnd-menu-action=\"snooze\">{{#t}}20 minutes{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"60\"   data-dnd-menu-action=\"snooze\">{{#t}}1 hour{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"120\"  data-dnd-menu-action=\"snooze\">{{#t}}2 hours{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"240\"  data-dnd-menu-action=\"snooze\">{{#t}}4 hours{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"480\"  data-dnd-menu-action=\"snooze\">{{#t}}8 hours{{\/t}}<\/a><\/li>\n<li role=\"menuitem\"><a data-snooze-length=\"1440\" data-dnd-menu-action=\"snooze\">{{#t}}24 hours{{\/t}}<\/a><\/li>";
