TS.raw_templates['star_item'] = "{{!-- hbslint-disable syntax --}}\n{{!-- TODO: Enable syntax linter and refactor to use a safeString --}}\n{{i18n_ns 'stars'}}\n\n{{#if_equal star.type compare=\"channel\"}}\n\t{{starWithTip 'channel' star.channel null}}\n\t<strong>{{{makeChannelLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(channel){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"group\"}}\n\t{{starWithTip 'group' star.channel null}}\n\t<strong>{{{makeGroupLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(private channel){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"im\"}}\n\t{{starWithTip 'im' star.channel null}}\n\t<strong>{{{makeIMLinkById star.channel}}}<\/strong> <span class=\"star_meta\">{{#t}}(direct message conversation){{\/t}}<\/span>\n{{\/if_equal}}\n\n{{#if_equal star.type compare=\"file_comment\"}}\n\t{{#if star.file.is_deleted}}\n\t{{else}}\n\t\t{{#if from_starred_item}}\n\t\t\t<div class=\"file_comment_item\">\n\t\t\t\t<div class=\"actions\">\n\t\t\t\t\t<div class=\"file_star btn_icon btn btn_outline ts_tip_btn ts_tip ts_tip_top\">\n\t\t\t\t\t\t{{starWithTip 'file_comment' star.comment star.file true}}\n\t\t\t\t\t<\/div>\n\t\t\t\t<\/div>\n\t\t\t\t{{{comment_standalone star.comment star.file true}}}\n\t\t\t<\/div>\n\t\t{{else}}\n\t\t\t{{starWithTip 'file_comment' star.comment star.file}}\n\t\t\t{{{comment_standalone star.comment star.file}}}\n\t\t{{\/if}}\n\t{{\/if}}\n{{\/if_equal}}\n\n";
TS.raw_templates['star_with_tip'] = "{{i18n_ns 'star'}}\n\n<button type=\"button\" {{#each html_attrs}}{{@key}}=\"{{this}}\" {{\/each}} class=\"{{#each class_names}}{{this}} {{\/each}}ts_tip ts_tip_multiline ts_tip_float ts_tip_hidden btn_unstyle\">\n\t<span class=\"ts_tip_tip\">\n\t\t<span class=\"ts_tip_multiline_inner\" data-tip-toggle-auto=\"{{#if is_starred}}{{star_str}}{{else}}{{unstar_str}}{{\/if}}\">\n\t\t\t{{#if is_starred}}{{unstar_str}}{{else}}{{star_str}}{{\/if}}\n\t\t<\/span>\n\t<\/span>\n<\/button>\n";
TS.raw_templates['purpose_dialog'] = "\t{{i18n_ns \"dialogs_purpose\"}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#if model_ob.purpose.value}}{{#t}}Edit channel purpose{{\/t}}{{else}}{{#t}}Set channel purpose{{\/t}}{{\/if}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\t\t<label for=\"purpose_input\" class=\"inline_block\" style=\"min-width: 6rem; padding-right: 1rem;\">\n\t\t\t{{#t name=\"Refers to channel purpose\"}}Purpose{{\/t}}<br \/>\n\t\t\t<span class=\"normal\">{{#t}}(optional){{\/t}}<\/span>\n\t\t<\/label>\n\n\t\t<div id=\"purpose_input\" tabindex=\"1\"><\/div>\n\t\t<div style=\"margin-left: 100px;\" class=\"candy_red too_long_warning hidden small small_top_margin\">{{#t}}text is too long!{{\/t}}<\/div>\n\n\t\t<span class=\"modal_input_note\" style=\"margin-left: 100px;\">\n\t\t\t{{#t}}Give your channel a purpose that describes what it will be used for.{{\/t}}\n\t\t\t{{#if model_ob.purpose.creator}}\n\t\t\t\t{{#if model_ob.purpose.value}}\n\t\t\t\t\t<br \/>\n\t\t\t\t\t{{#t creator=(makeMemberPreviewLinkById model_ob.purpose.creator) date=(toCalendarDate model_ob.purpose.last_set)}}The purpose was last set by {creator} on {date}.{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t{{\/if}}\n\t\t<\/span>\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\" tabindex=\"3\">{{#t}}Cancel{{\/t}}<\/button>\n\t\t<button type=\"button\" class=\"btn dialog_go\" tabindex=\"2\">{{#t note=\"Update channel purpose\"}}Update Purpose{{\/t}}<\/button>\n\t<\/div>\n";
TS.raw_templates['channel_prefs_dialog'] = "{{i18n_ns 'dialogs'}}\n{{> channel_prefs_options}}";
TS.raw_templates['channel_prefs_options'] = "{{i18n_ns \"prefs\"}}\n\n{{#unless embedded}}\n<div class=\"channel_prefs_modal_header modal-header\">\n\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t<h3>{{#t}}Notification Preferences: {display_name}{{\/t}} <span class=\"normal\" data-notification-table-header><\/span><\/h3>\n<\/div>\n{{\/unless}}\n<div class=\"channel_prefs_body {{#unless embedded}}modal-body{{\/unless}} feature_muting\">\n\t<div id=\"muting_div\" class=\"channel_prefs_body__muting_section\">\n\t\t<p class=\"channel_prefs_body__section_header_title inline_block\" data-muting-options-header>\n\t\t\t{{#t}}Muting options{{\/t}}\n\t\t<\/p>\n\t\t<div>\n\t\t\t<label class=\"channel_prefs__muting_checkbox_label checkbox\" id=\"muting_label\">\n\t\t\t\t<input id=\"muting_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\"\/>\n\t\t\t\t{{~#if is_mpim~}}\n\t\t\t\t\t{{#t}}Mute entire group DM{{\/t}}\n\t\t\t\t\t<div class=\"channel_prefs_body__mute_help_text\">{{#t}}You won't receive notifications for muted group DMs, and they'll appear grayed out in your channel list.{{\/t}}<\/div>\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{#t}}Mute entire channel{{\/t}}\n\t\t\t\t\t<div class=\"channel_prefs_body__mute_help_text\">{{#t}}You won't receive notifications for muted channels, and they'll appear grayed out in your channel list.{{\/t}}<\/div>\n\t\t\t\t{{\/if}}\n\t\t\t<\/label>\n\t\t<\/div>\n\n\t\t<div id=\"single_suppressed_div\">\n\t\t\t<p>\n\t\t\t\t<label class=\"channel_prefs__muting_checkbox_label checkbox\" id=\"single_suppressed_label\">\n\t\t\t\t\t<input id=\"single_suppressed_cb\" checked=\"checked\" type=\"checkbox\" class=\"small_right_margin\" \/>\n\t\t\t\t\t{{~#isChannelRequired model_ob~}}\n\t\t\t\t\t\t{{#t at_label=(atLabel 'everyone') at_here=(atLabel 'here')}}Ignore notifications for <strong>{at_label}<\/strong> and <strong>{at_here}<\/strong> <span id=\"single_suppressed_mobile_qualifier\">(on mobile)<\/span><span id=\"single_suppressed_desktop_qualifier\">(on desktop)<\/span><br><span id=\"single_suppressed_disabled_explain\" class=\"subtle_silver\">Disabled by <strong id=\"single_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">admin<\/strong><\/span>{{\/t}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{#t at_label=(atLabel 'channel') at_here=(atLabel 'here')}}Ignore notifications for <strong>{at_label}<\/strong> and <strong>{at_here}<\/strong> <span id=\"single_suppressed_mobile_qualifier\">(on mobile)<\/span><span id=\"single_suppressed_desktop_qualifier\">(on desktop)<\/span><br><span id=\"single_suppressed_disabled_explain\" class=\"subtle_silver\">Disabled by <strong id=\"single_suppressed_disabled_explain_tip_link\" class=\"cursor_pointer\">admin<\/strong><\/span>{{\/t}}\n\t\t\t\t\t{{\/isChannelRequired}}\n\t\t\t\t<\/label>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t<\/div>\n\n\t<div id=\"non_muting_prefs\" {{#if is_muted}}style=\"display: none\"{{\/if}}>\n\n\t\t<div id=\"notifications_not_working\" class=\"hidden\">\n\t\t\t<p class=\"channel_prefs_body__section_header\">\n\t\t\t\t<ts-icon class=\"notification_prefs_icon ts_icon_laptop ts_icon_inherit\"><\/ts-icon>\n\t\t\t\t{{#t}}Desktop notifications{{\/t}}\n\t\t\t<\/p>\n\t\t\t<p class=\"highlight_yellow_bg\">\n\t\t\t\t<span id=\"notifications_not_yet_allowed\" class=\"hidden\">{{#t}}You have not yet allowed desktop notifications. Open the <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications')\" class=\"cursor_pointer bold\">Preferences Dialog<\/a> and follow the instructions to set them up.{{\/t}}<\/span>\n\t\t\t\t<span id=\"notifications_not_enabled\" class=\"hidden\">{{#t}}You\u2018ve disabled desktop notifications. Open the <a onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications')\" class=\"cursor_pointer bold\">Preferences Dialog<\/a> to change that.{{\/t}}<\/span>\n\t\t\t\t<span id=\"notifications_not_allowed\" class=\"hidden\">{{#t}}You\u2018ve disallowed notifications in your browser. You\u2018ll need to open your browser preferences to change that.{{\/t}}<\/span>\n\t\t\t\t<span id=\"notifications_impossible\" class=\"hidden\">{{#t}}Your browser does not support desktop notifications. <a href=\"\/downloads\" target=\"_blank\">Try one of our apps?<\/a>{{\/t}}<\/span>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"notifications_working\" class=\"hidden\">\n\t\t\t<table class=\"channel_prefs_notifications_table\">\n\t\t\t\t<tr>\n\t\t\t\t\t<th class=\"channel_prefs_notifications_table__large_cell\"><span class=\"black\">{{#t}}Notifications{{\/t}}<\/span><\/th>\n\t\t\t\t\t<th class=\"channel_prefs_notifications_table__small_cell\">{{#t}}All new messages{{\/t}}<\/th>\n\t\t\t\t\t<th class=\"channel_prefs_notifications_table__small_cell\">{{#t}}Just mentions*{{\/t}}<\/th>\n\t\t\t\t\t<th class=\"channel_prefs_notifications_table__small_cell\">{{#t}}Nothing{{\/t}}<\/th>\n\t\t\t\t<\/tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__row_title\"><ts-icon class=\"notification_prefs_icon ts_icon_desktop_notification\"><\/ts-icon>{{#t}}Desktop{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_loud_rd\" value=\"everything\"><\/label><\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_loud_rd\" value=\"mentions\"><\/label><\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_loud_rd\" value=\"nothing\"><\/label><\/td>\n\t\t\t\t<\/tr>\n\t\t\t\t<tr>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__row_title\"><ts-icon class=\"notification_prefs_icon ts_icon_mobile_notification\"><\/ts-icon>{{#t}}Mobile{{\/t}}<\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_push_loud_rd\" value=\"everything\"><\/label><\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_push_loud_rd\" value=\"mentions\"><\/label><\/td>\n\t\t\t\t\t<td class=\"channel_prefs_notifications_table__small_cell\"><label class=\"radio\"><input type=\"radio\" name=\"channel_push_loud_rd\" value=\"nothing\"><\/label><\/td>\n\t\t\t\t<\/tr>\n\t\t\t<\/table>\n\n\t\t\t<p class=\"channel_prefs_help_text\">{{#t}}* Includes mentions of your name or any of your keywords{{\/t}}<\/p>\n\t\t<\/div>\n\n\t<\/div>\n<\/div>\n\n<div class=\"channel_prefs_modal_footer {{#unless embedded}}modal-footer{{\/unless}}\">\n\t{{#if embedded}}\n\t\t<p class=\"channel_prefs_modal_footer__text small_top_margin no_bottom_margin\"><button class=\"btn_link\" data-action=\"reset_channel_to_defaults\">{{#t}}Reset to your default notification settings{{\/t}}<\/button><\/p>\n\t{{else}}\n\t\t<p class=\"channel_prefs_modal_footer__text mini small_top_margin no_bottom_margin\">{{#t}}Set your default notifications settings in your <a href=\"\/account\/notifications\" onclick=\"TS.ui.channel_prefs_dialog.showMainPrefs('notifications'); return false;\" target=\"_blank\" class=\"bold\">Account Preferences<\/a>{{\/t}}<\/p>\n\t{{\/if}}\n\t<a class=\"btn {{#unless embedded}}dialog_go{{\/unless}} channel_prefs_modal_footer__btn\" data-action=\"done\">{{#t}}Done{{\/t}}<\/a>\n<\/div>";
TS.raw_templates['file_upload_dialog'] = "{{i18n_ns \"upload\"}}\n\n{{!-- hbslint-disable syntax --}}\n{{!-- Todo: enable syntax linter and refactor with safeString --}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#t note=\"Dialog title\" }}Upload a file? <span class=\"file_count\"><\/span>{{\/t}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body\">\n\n\t\t{{#if over_storage_limit}}\n\t\t\t<p class=\"alert alert_warning\">\n\t\t\t<i class=\"ts_icon ts_icon_info_circle\"><\/i>\n\t\t\t{{#feature flag=\"feature_teams_to_workspaces\"}}\n\t\t\t\t{{#t\n\t\t\t\t\tnote=\"Inline error message indicating the team's storage limit has been exceeded.\"\n\t\t\t\t}}\n\t\t\t\t\tYou are over your storage limit.<br \/> Please <a href=\"\/pricing?ui_step=70&ui_element=5\" target=\"{newWindowName}\" class=\"bold underline\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"pricing_link\" data-clog-ui-action=\"click\" data-clog-ui-step=\"file_upload\">upgrade to a paid plan<\/a>.\n\t\t\t\t{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t note=\"Inline error message indicating the team's storage limit has been exceeded.\"}}\n\t\t\t\t\tYour team is over its storage limit.<br \/> Please <a href=\"\/pricing?ui_step=70&ui_element=5\" target=\"{newWindowName}\" class=\"bold underline\" data-clog-event=\"GROWTH_PRICING\" data-clog-ui-element=\"pricing_link\" data-clog-ui-action=\"click\" data-clog-ui-step=\"file_upload\">upgrade to a paid plan<\/a>.\n\t\t\t\t{{\/t}}\n\t\t\t{{\/feature}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\n\t\t<div id=\"upload_image_preview\" class=\"hidden bottom_margin\">\n\t\t\t<img src=\"\" alt=\"{{#t note=\"Text description of the image preview for the file for users who are visually impaired\"}}Preview of {filename}{{\/t}}\" \/>\n\t\t<\/div>\n\n\t\t<p>\n\t\t\t<label for=\"upload_file_title\" class=\"inline_block\">{{#t note=\"Label for the title used to describe the file\"}}Title{{\/t}}<\/label>\n\t\t\t<input id=\"upload_file_title\" name=\"upload_file_title\" type=\"text\" class=\"small title_input\" value=\"{{title}}\" aria-describedby=\"upload_file_title_instructions\" \/>\n\t\t\t<span id=\"upload_file_title_instructions\" class=\"modal_input_note\">\n\t\t\t\t{{#t}}Titles are the easiest ways to search for files: it pays to be descriptive.{{\/t}}\n\t\t\t<\/span>\n\t\t\t<input id=\"upload_file_name\" name=\"upload_file_name\" type=\"hidden\" {{#if has_name}}disabled=\"disabled\"{{else}}{{\/if}} class=\"filename_input\" value=\"{{filename}}\" \/>\n\t\t<\/p>\n\n\t\t{{{sharing_html}}}\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t<div class=\"upload_actions\">\n\t\t\t{{#if file_retention_type}}\n\t\t\t\t<div class=\"modal_input_note_full_width small_bottom_margin align_right\">\n\t\t\t\t\t{{#feature flag=\"feature_teams_to_workspaces\"}}\n\t\t\t\t\t\t{{#t}}Due to your custom file retention <br \/>policy, this file will be deleted after <span class=\"bold\">{file_retention_duration}<\/span>.{{\/t}}\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t{{#t}}Due to your team\u2019s custom file retention <br \/>policy, this file will be deleted after <span class=\"bold\">{file_retention_duration}<\/span>.{{\/t}}\n\t\t\t\t\t{{\/feature}}\n\t\t\t\t<\/div>\n\t\t\t{{\/if}}\n\t\t\t{{#if more_in_queue}}<button type=\"button\" class=\"btn btn_outline dialog_cancel_all\">{{#t note=\"Label for the button that cancels uploading all files when multiple files have been selected for upload.\"}}Cancel All{{\/t}}<\/button>{{\/if}}\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\">{{#t note=\"Label for the cancel button that cancels uploading of the file and closes the dialog\"}}Cancel{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn dialog_go\">{{#t note=\"Label for the button that confirms the file should be uploaded\"}}Upload{{\/t}}<\/button>\n\t\t<\/div>\n\t\t<div class=\"modal-footer-confirm hidden\">\n\t\t\t<p class=\"confirm-text\">{{#t note=\"Inline confirmation message displayed if the dialog is dismissed\"}}Closing the window will discard your comment.{{\/t}}<\/p>\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_go\">{{#t note=\"Label for the cancel button accompanying the inline confirmation message. Cancels the request to close the dialog.\"}}Cancel{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn_danger dialog_cancel\">{{#t note=\"Label for a button accompanying the inline confirmation message. Closes the dialog without saving changes.\"}}Close Window{{\/t}}<\/button>\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['gdrive_create_dialog'] = "{{i18n_ns 'google_drive'}}\n\n<p>\n\t<label for=\"document_title\" class=\"inline_block\">{{#t}}Title{{\/t}}<\/label>\n\t<input id=\"document_title\" name=\"document_title\" type=\"text\" class=\"small title_input\" value=\"\" tabindex=\"1\" maxlength=\"255\" \/>\n\t<span class=\"modal_input_note\">\n\t\t{{#t}}Titles are the easiest ways to search for files: it pays to be descriptive.{{\/t}}\n\t<\/span>\n<\/p>\n\n{{sharing_html}}";
TS.raw_templates['share_dialog'] = "\t{{i18n_ns \"share_dialog\"}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>\n\t\t\t{{#if_equal type compare='file'}}{{#t}}Share file{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_snippet'}}{{#t}}Share snippet{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_post'}}{{#t}}Share post{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_space'}}{{#t}}Share post{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal type compare='file_arugula'}}{{#t}}Share arugula{{\/t}}{{\/if_equal}}\n\t\t<\/h3>\n\t<\/div>\n\t<div class=\"modal-body share_dialog\">\n\n\t\t<input type=\"hidden\" id=\"share_type\" value=\"{{type}}\" \/>\n\t\t<input type=\"hidden\" id=\"share_item_id\" value=\"{{item.id}}\" \/>\n\n\t\t{{file_html}}\n\n\t\t{{sharing_html}}\n\n\t<\/div>\n\t<div class=\"modal-footer\">\n\t\t{{#if show_copy_link}}\n\t\t\t<button class=\"btn btn_outline inline_flex ts_icon ts_icon_link ts_tip ts_tip_top ts_tip_float ts_tip_align_left ts_tip_multiline\" data-action=\"copy_link\" data-link=\"{{item.permalink}}\">\n\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">\n\t\t\t\t\t\t{{#if item.is_public}}\n\t\t\t\t\t\t\t{{#t}}Copy a link to this file.<br>To share, paste it anywhere.{{\/t}}\n\t\t\t\t\t\t{{else}}\n\t\t\t\t\t\t\t{{#t}}Copy a link to this file.<br>It\u2019s private, so sharing is limited.{{\/t}}\n\t\t\t\t\t\t{{\/if}}\n\t\t\t\t\t<\/span>\n\t\t\t\t<\/span>\n\t\t\t<\/button>\n\t\t{{\/if}}\n\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel\" tabindex=\"3\">{{#t}}Cancel{{\/t}}<\/button>\n\t\t<button type=\"button\" class=\"btn dialog_go\" tabindex=\"2\">{{#t}}Share{{\/t}}<\/button>\n\t<\/div>\n";
TS.raw_templates['snippet_dialog'] = "\t{{i18n_ns \"snippet\"}}\n\n\t{{!-- hbslint-disable syntax --}}\n\t{{!-- Todo: enable syntax linter and enable safeString --}}\n\n\t<div class=\"modal-header\">\n\t\t<button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n\t\t<h3>{{#if is_edit}}{{#t}}Edit snippet{{\/t}}{{else}}{{#t}}Create snippet{{\/t}}{{\/if}}<\/h3>\n\t<\/div>\n\t<div class=\"modal-body share_dialog\">\n\n\t\t<form action=\"\" id=\"client_file_snippet\" method=\"post\" accept-encoding=\"UTF-8\" onsubmit=\"return false;\" class=\"no_bottom_margin\">\n\n\t\t\t<div class=\"top_margin\">\n\t\t\t\t<label id=\"client_file_snippet_select_label\" class=\"select small float_right no_right_padding\">\n\t\t\t\t\t<select name=\"filetype\" id=\"client_file_snippet_select\" name=\"client_file_snippet_select\" class=\"small no_top_margin\">\n\t\t\t\t\t\t<option value=\"auto\">{{#t}}Auto Detect Type{{\/t}}<\/option>\n\t\t\t\t\t\t{{#each codemirror_types}}\n\t\t\t\t\t\t\t<option value=\"{{this.type}}\">{{this.label}}<\/option>\n\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t<\/select>\n\t\t\t\t<\/label>\n\t\t\t\t<input type=\"text\" id=\"client_file_snippet_title_input\" class=\"small\" name=\"client_file_snippet_title_input\" value=\"\" placeholder=\"{{#t}}Title (optional){{\/t}}\" \/>\n\t\t\t<\/div>\n\n\t\t\t<div class=\"top_margin bottom_margin\">\n\t\t\t\t<textarea name=\"content\" wrap=\"virtual\" id=\"client_file_snippet_textarea\" class=\"client_file_snippet_textarea full_width{{#unless is_edit}} create_snippet{{\/unless}}\"><\/textarea>\n\t\t\t\t<label class=\"checkbox normal mini float_right no_min_width\" style=\"margin-top: 3px; padding-right: 0; width: auto;\">\n\t\t\t\t\t<input type=\"checkbox\" id=\"client_file_wrap_cb\" {{#if wrap_lines}}checked{{\/if}}> {{#t note=\"Refers to line wraps \/ breaks when writing code in a snippet\"}}wrap{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t<\/div>\n\n\t\t\t{{{sharing_html}}}\n\n\t\t<\/form>\n\n\t<\/div>\n\n\t<div class=\"modal-footer\">\n\t\t<div class=\"modal-footer-confirm hidden\">\n\t\t\t<p class=\"confirm-text\">\n\t\t\t\t{{#if is_edit}}\n\t\t\t\t\t{{#t}}Are you sure you want to discard your changes?{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Are you sure you want to discard this snippet permanently?{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t\t\t<button type=\"button\" class=\"btn btn_outline dialog_cancel_decline\">{{#t}}No, keep it{{\/t}}<\/button>\n\t\t\t<button type=\"button\" class=\"btn btn_danger dialog_cancel\">\n\t\t\t\t{{#if is_edit}}\n\t\t\t\t\t{{#t}}Yes, discard the changes{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}Yes, discard this snippet{{\/t}}\n\t\t\t\t{{\/if}}\n\t\t\t<\/button>\n\t\t<\/div>\n\t\t<div class=\"modal-footer-action\">\n\t\t\t<a class=\"btn btn_outline cancel\" data-dismiss=\"modal\" tabindex=\"3\">{{#t}}Cancel{{\/t}}<\/a>\n\t\t\t{{#if is_edit}}\n\t\t\t<a class=\"btn dialog_go ts_tip ts_tip_top ts_tip_hide ts_tip_multiline ts_tip_float\" tabindex=\"2\">\n\t\t\t\t{{#t note=\"Button on snippet dialog\"}}Save changes{{\/t}}\n\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">{{#t note=\"Tooltip for 'Save changes' button on snippet dialog\"}}Add text before saving your changes{{\/t}}<\/span>\n\t\t\t\t<\/span>\n\t\t\t<\/a>\n\t\t\t{{\/if}}\n\t\t\t{{#unless is_edit}}\n\t\t\t<a class=\"btn dialog_go ts_tip ts_tip_top ts_tip_multiline ts_tip_float\" tabindex=\"2\">\n\t\t\t\t{{#t note=\"Button on snippet dialog\"}}Create Snippet{{\/t}}\n\t\t\t\t<span class=\"ts_tip_tip\">\n\t\t\t\t\t<span class=\"ts_tip_multiline_inner\">{{#t note=\"Tooltip for 'Create Snippet' button on snippet dialog\"}}Add text before saving your snippet{{\/t}}<\/span>\n\t\t\t\t<\/span>\n\t\t\t<\/a>\n\t\t\t{{\/unless}}\n\t\t<\/div>\n\t<\/div>\n";
TS.raw_templates['growl_prompt_overlay'] = "\t{{i18n_ns \"notifications\"}}\n\n\t<div id=\"growl_prompt_overlay\">\n\n\t\t<div id=\"growl_prompt_overlay_impossible\" class=\"hidden\">\n\t\t\t<h3>{{#t}}The browser you're using doesn't support desktop notifications.{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}When someone mentions you or sends you a direct message in Slack, we can let you know via a desktop notification.{{\/t}}<\/p>\n\t\t\t<p>{{#t new_win_name=(newWindowName)}}If you'd like to get desktop notifications from Slack, you can use a browser that supports them (like <a href=\"http:\/\/www.google.com\/chrome\/\" class=\"bold\">Google Chrome<\/a>), or download one of our <a href=\"\/downloads\" class=\"bold\" target=\"{new_win_name}\">desktop apps<\/a>.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"large_top_margin no_bottom_margin\">\n\t\t\t\t<a href=\"\/downloads\" class=\"btn btn_small  see-apps\" target=\"{{newWindowName}}\">{{#t note=\"Invites user to see our desktop app offerings, or dismiss the overlay with 'Not for me'\"}}See our Apps<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel_forever\">Not for me{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_start\" class=\"hidden\">\n\t\t\t<h3>{{#t}}Turn on desktop notifications?{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}When someone mentions you or sends you a direct message in Slack, we will let you know via a desktop notification.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"no_bottom_margin\">\n\t\t\t\t<a class=\"prompt_allow btn btn_small \">{{#t}}Yes, turn on notifications<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel_forever\">No, don't turn them on{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_tell_to_allow\" class=\"hidden\">\n\t\t\t<i class=\"ts_icon ts_icon_arrow_circle_up block float_right\" style=\"font-size: 3.5rem; margin: 0 1rem 0 0;\"><\/i>\n\t\t\t<h3>{{#t}}Turn on desktop notifications?{{\/t}}<\/h3>\n\t\t\t<p class=\"no_bottom_margin\">{{#t}}Click <strong>Allow<\/strong> above to turn on desktop notifications.{{\/t}}<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_success\" class=\"hidden\">\n\t\t\t<h3>{{#t}}Desktop notifications enabled{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}When someone mentions you or sends you a direct message in Slack, we will let you know via a desktop notification.{{\/t}}<\/p>\n\t\t\t<p style=\"line-height: 26px;\" class=\"no_bottom_margin\">\n\t\t\t\t<a class=\"prompt_test btn btn_small \">{{#t}}Send me a test notification<\/a>\n\t\t\t\t<span class=\"left_margin right_margin\">or<\/span>\n\t\t\t\t<a class=\"prompt_cancel\">I'm done{{\/t}}<\/a>\n\t\t\t<\/p>\n\t\t<\/div>\n\n\t\t<div id=\"growl_prompt_overlay_disallowed\" class=\"hidden\">\n\t\t\t<h3>{{#t}}Desktop notifications disabled{{\/t}}<\/h3>\n\t\t\t<p>{{#t}}You chose not to allow desktop notifications. You will need to update your browser preferences in order to turn them on.{{\/t}}<\/p>\n\t\t\t<p><a class=\"prompt_cancel btn btn_small float_right\">{{#t}}OK{{\/t}}<\/a><\/p>\n\t\t\t<div class=\"clear_both\"><\/div>\n\t\t<\/div>\n\n\t<\/div>\n";
TS.raw_templates['channel_invite_list'] = "{{i18n_ns 'channel_invite'}}\n\n<p class=\"top_margin no_bottom_margin invite_channels\">\n\t\t<label for=\"select_invite_channels\" class=\"inline_block lazy_filter_select\">\n\t\t\t{{#feature flag=\"feature_client_app_menu_cleanup\"}}\n\t\t\t\t{{#t}}Add to{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}Invite to{{\/t}}\n\t\t\t{{\/feature}}\n\t\t<\/label>\n\t\t<select id=\"select_invite_channels\" name=\"select_invite_channels\" class=\"file_share_select no_margin\">\n\t\t\t\t<option value=\"ts_null_value\">{{#t}}Select a channel{{\/t}}<\/option>\n\t\t\t\t{{#each channels}}\n\t\t\t\t\t\t<option value=\"{{this.id}}\">#{{this.name}}<\/option>\n\t\t\t\t{{\/each}}\n\t\t<\/select>\n\t\t<span class=\"modal_input_note hidden warning_already_member block\">\n\t\t\t{{#t}}{name} is already a member of this channel.{{\/t}}\n\t\t<\/span>\n<\/p>\n\n";
TS.raw_templates['group_member_invite_list'] = "{{i18n_ns \"invite\"}}\n\n<div id=\"group_invite_archives_prompt\" class=\"\">\n\t{{#t}}\n\t\t<p class=\"bold\">Should new members be allowed to see the private channel\u2019s message history?<\/p>\n\n\t\t<p>If <strong>Yes<\/strong>, new members will be invited and will have access to this private channel\u2019s entire message history.<\/p>\n\t\t<p>If <strong>No<\/strong>, this private channel will be renamed and archived. A new private channel will be created with all current members plus the new ones you invite. You and other current members will see a link back to the original private channel\u2019s archives.<\/p>\n\t{{\/t}}\n<\/div>\n";
TS.raw_templates['channel_conversion_dialog'] = "{{i18n_ns 'channel_options'}}\n\n<p>{{#t}}Converting <strong>#{name}<\/strong> to a private channel will preserve the history and membership.{{\/t}}<\/p>\n<p class=\"small_bottom_margin\"><strong>{{#t}}Two things you should know:{{\/t}}<\/strong><\/p>\n<ul>\n\t<li>{{#t}}This conversion is not reversible. It is a one-way street.{{\/t}}<\/li>\n\t<li>{{#t}}Files that were previously shared in this channel will not become private. They will remain publicly accessible to others on your team.{{\/t}}<\/li>\n<\/ul>\n<p>{{#t}}Are you sure you want to convert <strong>#{name}<\/strong> to a private channel?{{\/t}}<\/p>\n";
TS.raw_templates['channel_data_retention_dialog'] = "{{i18n_ns 'channel_options'}}\n\n{{#feature flag=\"feature_teams_to_workspaces\"}}\n\t<p>{{#t}}This message retention policy will only affect this {model_type, select, conversation {conversation} other {channel}}. Retention policies can also be set on a workspace-wide basis in your <a target=\"new\" href=\"\/admin\/settings#data_retention\">workspace settings<\/a>.{{\/t}}<\/p>\n{{else}}\n\t<p>{{#t}}This message retention policy will only affect this {model_type, select, conversation {conversation} other {channel}}. Retention policies can also be set on a team-wide basis in your <a target=\"new\" href=\"\/admin\/settings#data_retention\">team settings<\/a>.{{\/t}}<\/p>\n{{\/feature}}\n\n\n<p id=\"retention_duration_warning\" class=\"alert alert_warning hidden {{#isWeb}}small{{\/isWeb}}\">\n\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t<strong>{{#t}}An important note about message retention policies{{\/t}}<\/strong><br \/>\n\t{{#t}}Setting a custom duration for message retention means that messages in this {model_type, select, conversation {conversation} other {channel}} will be deleted after the number of days you set. This deletion is permanent and the messages will be irretrievable. Proceed with caution!{{\/t}}\n<\/p>\n\n<div class=\"clearfix\">\n\t{{#isWeb}}\n\t\t<p class=\"col span_4_of_6\">\n\t\t\t<label for=\"retention_type\" class=\"select small\">\n\t\t\t\t{{#t}}Retention Type{{\/t}}\n\t\t\t\t<select name=\"retention_type\" class=\"small\">\n\t\t\t\t\t{{#feature flag=\"feature_teams_to_workspaces\"}}\n\t\t\t\t\t\t<option value=\"0\"{{#if_equal retention_type compare=0}} selected=\"selected\"{{\/if_equal}}>{{#t}}Use workspace preference{{\/t}}<\/option>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<option value=\"0\"{{#if_equal retention_type compare=0}} selected=\"selected\"{{\/if_equal}}>{{#t}}Use team preference{{\/t}}<\/option>\n\t\t\t\t\t{{\/feature}}\n\t\t\t\t\t<option value=\"1\"{{#if_equal retention_type compare=1}} selected=\"selected\"{{\/if_equal}}>{{#t}}Retain all messages for a specific number of days{{\/t}}<\/option>\n\t\t\t\t<\/select>\n\t\t\t<\/label>\n\t\t<\/p>\n\t\t<p class=\"col span_2_of_6 {{#if_equal retention_type compare=0}}hidden{{\/if_equal}}\" id=\"retention_duration_container\">\n\t\t\t<label for=\"retention_duration\">{{#t}}Duration{{\/t}}<\/label>\n\t\t\t<input type=\"text\" name=\"retention_duration\" id=\"retention_duration\" class=\"mini align_right\" value=\"{{retention_duration}}\" \/> {{#t}}days{{\/t}}\n\t\t<\/p>\n\t{{else}}\n\t\t<p class=\"col span_4_of_6\">\n\t\t\t<label for=\"retention_type\" class=\"select small full_width align_left\">\n\t\t\t\t{{#t}}Retention Type{{\/t}}\n\t\t\t\t<select name=\"retention_type\" class=\"small\">\n\t\t\t\t\t{{#feature flag=\"feature_teams_to_workspaces\"}}\n\t\t\t\t\t\t<option value=\"0\"{{#if_equal retention_type compare=0}} selected=\"selected\"{{\/if_equal}}>{{#t}}Use workspace preference{{\/t}}<\/option>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<option value=\"0\"{{#if_equal retention_type compare=0}} selected=\"selected\"{{\/if_equal}}>{{#t}}Use team preference{{\/t}}<\/option>\n\t\t\t\t\t{{\/feature}}\n\t\t\t\t\t<option value=\"1\"{{#if_equal retention_type compare=1}} selected=\"selected\"{{\/if_equal}}>{{#t}}Retain all messages for a specific number of days{{\/t}}<\/option>\n\t\t\t\t<\/select>\n\t\t\t<\/label>\n\t\t<\/p>\n\n\t\t<div class=\"col span_2_of_6 {{#if_equal retention_type compare=0}}hidden{{\/if_equal}}\" id=\"retention_duration_container\">\n\t\t\t<label for=\"retention_duration\" class=\"align_left\">{{#t}}Duration{{\/t}}<\/label>\n\t\t\t<div class=\"input-append no_bottom_margin\">\n\t\t\t\t<input type=\"text\" name=\"retention_duration\" id=\"retention_duration\" class=\"input-mini align_right\" value=\"{{retention_duration}}\" style=\"border-radius: 4px 0 0 4px !important; width: 60px; height: 37px;\" \/>\n\t\t\t\t<span class=\"add-on\" style=\"line-height: 27px;\">{{#t}}days{{\/t}}<\/span>\n\t\t\t<\/div>\n\t\t<\/div>\n\t{{\/isWeb}}\n<\/div>\n\n<div id=\"team_retention_pref\" class=\"hidden\">\n\t<p>\n\t\t{{#feature flag=\"feature_teams_to_workspaces\"}}\n\t\t\t{{#if_equal team_type compare=0}}{{#t}}The workspace preference is to <strong>retain all messages.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=1}}{{#t}}The workspace preference is to <strong>retain all messages AND also retain edit and deletion logs for all messages.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=2}}{{#t}}The workspace preference is to <strong>retain all messages for {team_duration, plural, =1 {# day} other {# days}}.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=3}}{{#t}}The workspace preference is to <strong>retain all messages for {team_duration, plural, =1 {# day} other {# days}} but keep logs for compliance exports.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t{{else}}\n\t\t\t{{#if_equal team_type compare=0}}{{#t}}The team preference is to <strong>retain all messages.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=1}}{{#t}}The team preference is to <strong>retain all messages AND also retain edit and deletion logs for all messages.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=2}}{{#t}}The team preference is to <strong>retain all messages for {team_duration, plural, =1 {# day} other {# days}}.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t\t{{#if_equal team_type compare=3}}{{#t}}The team preference is to <strong>retain all messages for {team_duration, plural, =1 {# day} other {# days}} but keep logs for compliance exports.<\/strong>{{\/t}}{{\/if_equal}}\n\t\t{{\/feature}}\n\t<\/p>\n<\/div>\n\n<div class=\"alert alert_warning hidden invalid_duration_error\">\n\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t{{#t}}You must set a number of days greater than zero for message retention.{{\/t}}\n<\/div>\n";
TS.raw_templates['channel_deletion_dialog'] = "{{i18n_ns 'web_channel'}}\n\n<p>{{#t}}Are you sure you want to delete <strong>{name}<\/strong>? All its content will be removed from your Slack archives, and you cannot restore the content once deleted.{{\/t}}<\/p>\n<p class=\"large_left_margin no_bottom_margin\">\n    <label class=\"checkbox normal\" style=\"font-size: 1rem;\">\n        <input id=\"delete_channel_cb\" type=\"checkbox\" class=\"small_right_margin\" \/>\n        {{#t}}Yes, I am absolutely sure{{\/t}}\n    <\/label>\n<\/p>\n";
TS.raw_templates['channel_option_archive'] = "{{i18n_ns 'channel_options'}}\n\n<p>{{#t}}Archiving is useful if you don\u2019t think you\u2019ll need this channel any longer. Here\u2019s what will happen when you archive this channel:{{\/t}}<\/p>\n<ul>\n\t<li>{{#t}}No one will be able to send messages to it{{\/t}}<\/li>\n\t<li>{{#t}}Apps installed in this channel will be disabled{{\/t}}<\/li>\n\t<li>{{#t}}A message will be posted that you archived the channel{{\/t}}<\/li>\n<\/ul>\n\n<p>{{#t}}Messages from archived channels will still show up in search and archives, the same way they do today. You can always un-archive an archived channel later, if you need it again.{{\/t}}<\/p>\n\n<p>{{#t name=name}}Are you sure you want to archive {name}?{{\/t}}<\/p>\n";
TS.raw_templates['channel_share_dialog_create'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-share_channel_dialog__contents\">\n\n\t<h3 class=\"p-share_channel_dialog__subheading\">\n\t\t\t{{#t}}Step 1 of 2{{\/t}}\n\t<\/h3>\n\n\t<h1 class=\"p-share_channel_dialog__heading\">\n\t\t\t{{#t}}Create a shared channel{{\/t}}\n\t<\/h1>\n\n\t<p class=\"p-share_channel_dialog__description\">\n\t\t{{#t}}First, choose a name and privacy setting for your channel.{{\/t}}\n\t<\/p>\n\n\t<div class=\"medium_bottom_margin\">\n\t\t<label class=\"radio\">\n\t\t\t<input\n\t\t\t\ttype=\"radio\"\n\t\t\t\tname=\"channel_privacy\"\n\t\t\t\tvalue=\"public\"\n\t\t\t\t{{#unless is_private}}\n\t\t\t\t\tchecked=\"checked\"\n\t\t\t\t\taria-checked=\"true\"\n\t\t\t\t{{\/unless}}\n\t\t\t\/>{{#t}}Public <span class=\"normal small_left_margin\">Any member of your workspace can join<\/span>{{\/t}}\n\t\t<\/label>\n\t\t{{#feature flag=\"feature_esc_connecting_private_shared_channels\"}}\n\t\t\t<label class=\"radio small_top_margin\">\n\t\t\t\t<input\n\t\t\t\t\ttype=\"radio\"\n\t\t\t\t\tname=\"channel_privacy\"\n\t\t\t\t\tvalue=\"private\"\n\t\t\t\t\t{{#if is_private}}\n\t\t\t\t\t\tchecked=\"checked\"\n\t\t\t\t\t\taria-checked=\"true\"\n\t\t\t\t\t{{\/if}}\n\t\t\t\t\/>\n\t\t\t\t\t{{#t note=\"Channel privacy option\"}}Private <span class=\"normal small_left_margin\">This channel can only be joined or viewed by invite<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t{{else}}\n\t\t\t<label class=\"radio disabled small_top_margin\">\n\t\t\t\t<input\n\t\t\t\t\ttype=\"radio\"\n\t\t\t\t\tname=\"channel_privacy\"\n\t\t\t\t\tvalue=\"private\"\n\t\t\t\t\tdisabled=\"disabled\"\n\t\t\t\t\taria-disabled=\"true\"\n\t\t\t\t\t{{#if is_private}}\n\t\t\t\t\t\tchecked=\"checked\"\n\t\t\t\t\t\taria-checked=\"true\"\n\t\t\t\t\t{{\/if}}\n\t\t\t\t\/>\n\t\t\t\t{{#t note=\"Channel privacy option\"}}Private <span class=\"normal small_left_margin\">Not available in beta<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t{{\/feature}}\n\t\t<div class=\"alert alert_warning top_margin hidden\" data-alert=\"private_channel\">\n\t\t\t<ts-icon class=\"ts_icon_warning\"><\/ts-icon>\n\t\t\t{{#t}}<strong>Note:<\/strong> This setting only applies to <strong>{team.name}<\/strong>. The channel won\u2019t necessarily be private on other workspaces.{{\/t}}\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"medium_bottom_margin\">\n\t\t<label for=\"channel_name\" class=\"block align_left\">{{#t}}Name{{\/t}}<\/label>\n\t\t<div class=\"channel_modal_title_input_container\">\n\t\t\t<i class=\"channel_icon private_channel_item subtle_silver ts_icon_lock ts_icon hidden\" \/>\n\t\t\t<i class=\"channel_icon public_channel_item subtle_silver ts_icon_channel ts_icon\" \/>\n\t\t\t<input\n\t\t\t\tname=\"channel_name\"\n\t\t\t\ttype=\"text\"\n\t\t\t\tclass=\"lowercase title_input large_left_padding tiny_bottom_margin\"\n\t\t\t\tplaceholder=\"{{#t note=\"placeholder for a channel name input\"}}e.g. leads{{\/t}}\"\n\t\t\t\tdata-input=\"channel_name\"\n\t\t\t\tdata-validation=\"channel_name=fix\"\n\t\t\t\tdata-validation-for=\"channel_name\"\n\t\t\t\tdata-validation-success=\"\"\n\t\t\t\tautocapitalize=\"off\"\n\t\t\t\tautocorrect=\"off\"\n\t\t\t\tautocomplete=\"off\"\n\t\t\t\tvalue=\"{{channel_name}}\"\n\t\t\t\/>\n\t\t<\/div>\n\t\t<span class=\"modal_input_note margin_auto\">\n\t\t\t{{#t}}Names must be lowercase, without spaces or periods, and shorter than 22 characters.{{\/t}}\n\t\t<\/span>\n\t<\/div>\n\n\t<div class=\"large_bottom_margin\">\n\t\t<label for=\"invite_members_input\" class=\"block align_left\">\n\t\t\t{{#t}}Invite people <span class=\"normal\">(optional)<\/span>{{\/t}}\n\t\t<\/label>\n\t\t<div class=\"p-share_channel_dialog__invite_people_wrapper\">\n\t\t\t<div id=\"invite_people_picker\"><\/div>\n\t\t<\/div>\n\t<\/div>\n\n\t{{> shared_channels_retention_disclaimer}}\n<\/div>\n";
TS.raw_templates['channel_stop_sharing_dialog'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-stop_sharing_channel_dialog__contents\">\n\t<div class=\"p-stop_sharing_channel_dialog__last_channel_alert c-alert c-alert--inline c-alert--level_error hidden{{#if full_screen}} large_bottom_margin{{else}} very_small_top_margin bottom_margin{{\/if}}\">\n\t\t<div class=\"c-alert__message\">\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t<strong>\n\t\t\t\t\t{{#t team_names=(makeTeamNameList model_ob.shared_team_ids)}}This is your only shared channel with <span class=\"p-stop_sharing_channel_dialog__last_channel_team_names\">{team_names}<\/span>{{\/t}}\n\t\t\t\t<\/strong>\n\t\t\t<\/p>\n\t\t\t<p class=\"no_bottom_margin\">\n\t\t\t\t{{#t}}If you stop sharing this channel, you won\u2019t be able to direct message members of their workspace.{{\/t}}\n\t\t\t<\/p>\n\t\t<\/div>\n\t<\/div>\n\n\t<div class=\"p-stop_sharing_channel_dialog__description\">\n\t\t<p>\n\t\t\t{{#t}}You can stop sharing this channel at any time. Here\u2019s what will happen:{{\/t}}\n\t\t<\/p>\n\n\t\t{{> shared_channels_disconnect_channel_expectations}}\n\n\t\t<p class=\"{{#if full_screen}}large_bottom_margin{{else}}no_bottom_margin{{\/if}}\">\n\t\t\t{{#if model_ob.shared_team_ids.length}}\n\t\t\t\t{{#t team_names=(makeTeamNameList model_ob.shared_team_ids strong=true) channel_name=(makeModelObNameForDisplay model_ob inherit_font_size=true)}}Are you sure you want to stop sharing <strong>{channel_name}<\/strong> with {team_names}?{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t team_names=(makeTeamNameList model_ob.pending_shared strong=true) channel_name=(makeModelObNameForDisplay model_ob inherit_font_size=true)}}Are you sure you want to stop sharing <strong>{channel_name}<\/strong> with {team_names}?{{\/t}}\n\t\t\t{{\/if}}\n\t\t<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channel_share_dialog_invite'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-share_channel_dialog__contents\">\n\n\t{{#if show_heading}}\n        <h3 class=\"p-share_channel_dialog__subheading\">\n                {{#t}}Step 2 of 2{{\/t}}\n        <\/h3>\n\n\t\t<h1 class=\"p-share_channel_dialog__heading\">\n\t\t\t\t{{#t}}Send an invitation{{\/t}}\n\t\t<\/h1>\n\t{{\/if}}\n\n    {{#if sharing_existing_channel}}\n        <p class=\"p-share_channel_dialog__description--channel-options-menu\">\n            {{#t}}To share this channel, you\u2019ll need the contact info of an admin at the other workspace. <strong>Note:<\/strong> this will also share all of the existing messages and files in the channel.{{\/t}}\n        <\/p>\n\n        {{> shared_channels_retention_disclaimer}}\n    {{else}}\n        <p class=\"p-share_channel_dialog__description\">\n            {{#feature flag=\"feature_teams_to_workspaces\"}}\n                {{#t}}Next, invite another workspace. You\u2019ll need an admin\u2019s contact info, and they\u2019ll receive this via Slackbot.{{\/t}}\n            {{else}}\n                {{#t}}Next, invite another team. You\u2019ll need an admin\u2019s contact info, and they\u2019ll receive this via Slackbot.{{\/t}}\n            {{\/feature}}\n        <\/p>\n    {{\/if}}\n\n\t<div class=\"alert alert_error large_bottom_margin hidden\" data-label=\"shared_channel_form_error\">\n\t\t<ts-icon class=\"ts_icon_warning\"><\/ts-icon>\n\t\t<span data-label=\"shared_channel_form_error_label\"><\/span>\n\t<\/div>\n\n\t{{> channel_share_dialog_invite_fields}}\n\n\t{{#if sharing_existing_channel}}\n\t\t<p class=\"align_right large_top_margin\">\n\t\t\t<button class=\"btn btn_large btn_outline btn cancel_share\" type=\"button\">{{#t}}Cancel{{\/t}}<\/button>\n\t\t\t<button class=\"btn btn_large ladda-button submit\" data-style=\"expand-right\">{{#t note=\"Form submit button label\"}}Share Channel{{\/t}}<\/button>\n\t\t<\/p>\n\t{{\/if}}\n\n<\/div>\n";
TS.raw_templates['channel_revoke_share_invite_dialog'] = "{{i18n_ns 'shared_channels'}}\n\n{{#feature flag=\"feature_esc_cancel_invitations_button\"}}\n    <div class=\"p-channel_revoke_share_invite_dialog__contents\">\n        <p class=\"p-revoke_share_invite_dialog__description\">\n            {{#unless invite_sent_by_user}} \n                {{#t channel_name=(makeModelObNameForDisplay model_ob inherit_font_size=true)}}Are you sure you want to cancel? This invitation to share <strong>{channel_name}<\/strong> was sent to <strong>{target_team.name}<\/strong> by another administrator on your workspace ({inviter_name}).{{\/t}}\n            {{else}}\n                {{#t channel_name=(makeModelObNameForDisplay model_ob inherit_font_size=true)}}Are you sure you want to cancel your invitation to share <strong>{channel_name}<\/strong> with <strong>{target_team.name}<\/strong>?{{\/t}} \n            {{\/unless}}\n        <\/p>\n    <\/div>\n{{\/feature}}";
TS.raw_templates['channel_share_dialog_invite_fields'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"medium_bottom_margin\">\n\t<label class=\"p-share_channel_dialog__input_label\" for=\"email_address\">\n\t\t<span class=\"inline_block small_right_margin\">{{#t note=\"Input label for share channel form\"}}Admin\u2019s email address{{\/t}}<\/span>\n\t<\/label>\n\t<div class=\"p-share_channel_dialog__input_wrapper\">\n\t\t<input\n\t\t\tclass=\"tiny_bottom_margin\"\n\t\t\ttype=\"text\"\n\t\t\tname=\"email_address\"\n\t\t\tplaceholder=\"{{#t}}jane@acme-corp.com{{\/t}}\"\n\t\t\tdata-input=\"email_address\"\n\t\t\tdata-validation=\"is_email=fix\"\n\t\t\tdata-validation-for=\"email_address\"\n\t\t\tdata-validation-success=\"\"\n\t\t\t{{#if email_address}}value={{email_address}}{{\/if}}\n\t\t\/>\n\t<\/div>\n<\/div>\n\n<div class=\"medium_bottom_margin\">\n\t<label class=\"p-share_channel_dialog__input_label\" for=\"team_url\">\n\t\t{{#t note=\"Input label for share channel form\"}}Slack URL{{\/t}}\n\t<\/label>\n\t<div class=\"p-share_channel_dialog__input_wrapper\">\n\t\t<input\n\t\t\tclass=\"p-share_channel_dialog__team_url tiny_bottom_margin\"\n\t\t\ttype=\"text\"\n\t\t\tname=\"team_url\"\n\t\t\tplaceholder=\"{{#t}}acme-corp{{\/t}}\"\n\t\t\tdata-validation=\"required\"\n\t\t\tdata-input=\"team_url\"\n\t\t\t{{#if team_url}}value={{team_url}}{{\/if}}\n\t\t\/>\n\t\t<span class=\"p-share_channel_dialog__team_url_suffix\">\n\t\t\t.slack.com\n\t\t<\/span>\n\t<\/div>\n\t<span class=\"modal_input_note margin_auto\">\n\t\t{{#t locale=(zdLocale)}}\n\t\t\t<a href=\"https:\/\/get.slack.help\/hc\/{locale}\/articles\/221769328-Find-your-Slack-team-URL\" target=\"_blank\">What\u2019s a Slack URL?<\/a>\n\t\t{{\/t}}\n\t<\/span>\n<\/div>\n\n<div class=\"small_bottom_margin\">\n\t<label class=\"p-share_channel_dialog__input_label\" for=\"custom_message\">\n\t\t<span class=\"inline_block small_right_margin\">{{#t note=\"Input label for share channel form\"}}Add a message{{\/t}}<\/span>\n\t<\/label>\n\n\t<div class=\"p-share_channel_dialog__custom_message_container\">\n\t\t<div class=\"p-share_channel_dialog__custom_message_user medium_bottom_margin\">\n\t\t\t<div class=\"c-member c-member--medium\">\n\t\t\t\t<span class=\"member_image\">\n\t\t\t\t\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs inviter 36 false true false)}}\n\t\t\t\t\t{{> member_type_external_badge size=36 badge_size=(getTeamBadgeSize size) with_tooltip=true}}\n\t\t\t\t<\/span>\n\t\t\t\t<div class=\"c-member__flex-container--medium\">\n\t\t\t\t\t<div class=\"c-member__name c-member__name--medium\">\n\t\t\t\t\t\t<span class=\"c-member__display-name c-member__display-name--medium\">{{getPrefCompliantMemberName inviter}}<\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<div class=\"c-member__title c-member__title--medium\">{{team.name}}<\/div>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t<textarea\n\t\t\tclass=\"p-share_channel_dialog__custom_message_input\"\n\t\t\tname=\"custom_message\"\n\t\t\tdata-input=\"custom_message\"\n\t\t\tmaxlength=\"560\"\n\t\t\tdata-validation=\"hasnourl\"\n\t\t\tplaceholder=\"{{#t note=\"placeholder for a message input\"}}e.g. Hi there! I\u2019m working on a project with...{{\/t}}\"\n\t\t>{{#if custom_message}}{{custom_message}}{{\/if}}<\/textarea>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channel_share_dialog_invite_wrapper'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-share_channel_dialog__channel_options_header\">\n        {{#t}}Share <strong>{channel_name}<\/strong> with another workspace{{\/t}}\n<\/div>\n\n{{> channel_share_dialog_invite }}\n";
TS.raw_templates['channel_share_dialog_request'] = "{{i18n_ns 'shared_channels'}}\n\n<div class=\"p-share_channel_dialog__contents\">\n\t\t<h1 class=\"share_channel_modal_heading\">\n\t\t\t{{#t}}Shared channel invitation{{\/t}}<\/h1>\n\t\t<\/h1>\n\n\t\t<p>{{#t}}<strong>{inviting_team.name}<\/strong> would like to share a channel with your workspace.{{\/t}}<\/p>\n\n\t\t{{> shared_channels_retention_disclaimer}}\n\n\t\t<h2 class=\"large_top_margin\">{{#t}}Invited by{{\/t}}<\/h2>\n\n\t\t <div class=\"p-share_channel_request_dialog__inviter small_bottom_margin\">\n\t\t\t<div class=\"c-member c-member--large\">\n\t\t\t\t<span class=\"member_image\">\n\t\t\t\t\t{{> member_preview_link_image (getMemberPreviewLinkImageArgs inviter 44 false true false)}}\n\t\t\t\t\t{{> member_type_external_badge size=44 team=inviting_team badge_size=(getTeamBadgeSize size) with_tooltip=true}}\n\t\t\t\t<\/span>\n\t\t\t\t<div class=\"c-member__flex-container--large\">\n\t\t\t\t\t<div class=\"c-member__name c-member__name--large\">\n\t\t\t\t\t\t<span class=\"c-member__display-name c-member__display-name--large\">{{getPrefCompliantMemberName inviter}}<\/span>\n\t\t\t\t\t<\/div>\n\t\t\t\t\t<div class=\"c-member__title c-member__title--large\">{{inviting_team.name}}<\/div>\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t{{#if custom_message}}\n\t\t<div class=\"bottom_margin\">\n\t\t\t{{#t note=\"Custom message for a shared channel invitation, wrapped in quotes\" custom_message=custom_message}}\n\t\t\t\t\u201c{custom_message}\u201d\n\t\t\t{{\/t}}\n\t\t<\/div>\n\t\t{{\/if}}\n\n\t\t<h2 class=\"large_top_margin small_bottom_margin\">{{#t}}Channel details{{\/t}}<\/h2>\n\t\t<p class=\"greigh large_bottom_margin\">\n\t\t\t{{#t}}You can edit these if you\u2019d like. Changes you make will only affect <strong>{team.name}<\/strong>.{{\/t}}\n\t\t<\/p>\n\n\t\t<div class=\"alert alert_error large_bottom_margin hidden\" data-label=\"shared_channel_form_error\">\n\t\t\t<ts-icon class=\"ts_icon_warning\"><\/ts-icon>\n\t\t\t<span data-label=\"shared_channel_form_error_label\"><\/span>\n\t\t<\/div>\n\n\t\t<div class=\"medium_bottom_margin\">\n\t\t\t<label class=\"radio\">\n\t\t\t\t{{#t}}<input type=\"radio\" name=\"channel_privacy\" value=\"public\" checked=\"checked\" aria-checked=\"true\">Public <span class=\"normal small_left_margin\">Any member of your workspace can join<\/span>{{\/t}}\n\t\t\t<\/label>\n\n\t\t\t{{#feature flag=\"feature_esc_connecting_private_shared_channels\"}}\n\t\t\t\t<label class=\"radio small_top_margin\">\n\t\t\t\t\t<input\n\t\t\t\t\t\ttype=\"radio\"\n\t\t\t\t\t\tname=\"channel_privacy\"\n\t\t\t\t\t\tvalue=\"private\"\n\t\t\t\t\t\/>\n\t\t\t\t\t{{#t note=\"Channel privacy option\"}}Private <span class=\"normal small_left_margin\">This channel can only be joined or viewed by invite<\/span>{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t{{else}}\n\t\t\t\t<label class=\"radio disabled small_top_margin\">\n\t\t\t\t\t<input\n\t\t\t\t\t\ttype=\"radio\"\n\t\t\t\t\t\tname=\"channel_privacy\"\n\t\t\t\t\t\tvalue=\"private\"\n\t\t\t\t\t\tdisabled=\"disabled\"\n\t\t\t\t\t\taria-disabled=\"true\"\n\t\t\t\t\t\/>\n\t\t\t\t\t{{#t note=\"Channel privacy option\"}}Private <span class=\"normal small_left_margin\">Not available in beta<\/span>{{\/t}}\n\t\t\t\t<\/label>\n\t\t\t{{\/feature}}\n\n\t\t\t<div class=\"alert alert_warning top_margin hidden\" data-alert=\"private_channel\">\n\t\t\t\t<ts-icon class=\"ts_icon_warning\"><\/ts-icon>\n\t\t\t\t{{#t}}<strong>Note:<\/strong> This setting only applies to <strong>{team.name}<\/strong>. The channel won\u2019t necessarily be private on other workspaces.{{\/t}}\n\t\t\t<\/div>\n\t\t<\/div>\n\n\t\t<div class=\"medium_bottom_margin\">\n\t\t\t<label for=\"channel_name\" class=\"p-share_channel_dialog__input_label\">\n\t\t\t\t<span class=\"inline_block small_right_margin\">{{#t}}Name{{\/t}}<\/span>\n\t\t\t<\/label>\n\t\t\t<div class=\"channel_modal_title_input_container no_margin\">\n\t\t\t\t<i class=\"channel_icon private_channel_item subtle_silver ts_icon_lock ts_icon hidden\" \/>\n\t\t\t\t<i class=\"channel_icon public_channel_item subtle_silver ts_icon_channel ts_icon\" \/>\n\t\t\t\t<input\n\t\t\t\t\tname=\"channel_name\"\n\t\t\t\t\ttype=\"text\"\n\t\t\t\t\tclass=\"lowercase title_input large_left_padding tiny_bottom_margin\"\n\t\t\t\t\tautocapitalize=\"off\"\n\t\t\t\t\tautocorrect=\"off\"\n\t\t\t\t\tautocomplete=\"off\"\n\t\t\t\t\tdata-input=\"channel_name\"\n\t\t\t\t\tdata-validation=\"channel_name=fix\"\n\t\t\t\t\tdata-validation-for=\"channel_name\"\n\t\t\t\t\tdata-validation-success=\"\"\n\t\t\t\t\tvalue=\"{{channel_name}}\"\n\t\t\t\t\/>\n\t\t\t<\/div>\n\t\t\t<span class=\"modal_input_note margin_auto\">\n\t\t\t\t{{#t}}Names must be lowercase, without spaces or periods, and shorter than 22 characters.{{\/t}}\n\t\t\t<\/span>\n\t\t<\/div>\n\n\t\t<div>\n\t\t\t<label for=\"invite_members_input\" class=\"block align_left\">\n\t\t\t\t{{#t}}Invite people <span class=\"normal\">(optional)<\/span>{{\/t}}\n\t\t\t<\/label>\n\t\t\t<div class=\"p-share_channel_dialog__invite_people_wrapper\">\n\t\t\t\t<div id=\"invite_people_picker\"><\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n<\/div>\n";
TS.raw_templates['channel_share_dialog_error'] = "{{i18n_ns 'shared_channels'}}\n\n{{#if_equal error compare=\"invalid_target_domain\"}}\n    {{#t}}<strong>{target_domain}.slack.com doesn\u2019t appear to be in use.<\/strong> If you\u2019re sure you entered it correctly, you may need to ask your contact to double-check their Slack URL.{{\/t}}\n{{\/if_equal}}\n\n{{#if_equal error compare=\"shared_channel_invites_disabled\"}}\n    {{#t}}<strong>{target_domain}.slack.com doesn\u2019t accept shared channel invitations.<\/strong> You may want to ask their admin to change this setting.{{\/t}}\n{{\/if_equal}}\n\n{{#if_equal error compare=\"not_in_shared_channels_beta\"}}\n    {{#t}}<strong>{target_domain}.slack.com hasn\u2019t joined the shared channels beta.<\/strong> They\u2019ll need to do so before you can share a channel.{{\/t}}\n{{\/if_equal}}\n\n{{#if_equal error compare=\"target_team_is_enterprise\"}}\n    {{#t}}<strong>During the beta, you can\u2019t share channels with organizations on Enterprise Grid.<\/strong> This is one of those rough edges we\u2019re still smoothing over \u2014 stay tuned.{{\/t}}\n{{\/if_equal}}\n";
TS.raw_templates['coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"coachmark\" class=\"normal hidden\">\n\t<div id=\"coachmark_callout\"><\/div>\n\t<div id=\"coachmark_interior\">\n\t\t{{#if has_close_btn}}\n\t\t<a class=\"coachmark_close_btn\">\n\t\t\t<i class=\"ts_icon ts_icon_times\"><\/i>\t\n\t\t<\/a>\n\t\t{{\/if}}\n\t\t{{! content divs are dynamically added depending on what type of coachmark is being shown }}\n\t\t{{#unless no_footer}}\n\t\t<div id=\"coachmark_footer\">\n\t\t\t<div class=\"coachmark_footer_text\">\n\t\t\t\t{{#t}}<span>Done? <\/span><a class=\"coachmark_skip_link\">Click here to skip<\/a>{{\/t}}\n\t\t\t<\/div>\n\t\t\t<a class=\"btn coachmark_got_it float_right hidden\">{{#t}}Got it!{{\/t}}<\/a>\n\n\t\t\t<a class=\"btn coachmark_next_tip float_right\">{{#t}}Next Tip{{\/t}}<\/a>\n\t\t<\/div>\n\t\t{{\/unless}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['channels_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n{{!-- TODO: move to separate templates... so many conditions --}}\n<div id=\"channels_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">\n\t\t\t{{#t}}Messaging happens in channels{{\/t}}\n\t\t<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t<p>{{#t}}Channels bring order and searchability to your team\u2019s conversations. Organize by topic (#research), working group (#sales), or specific project (#sales-tv-ad).{{\/t}}<\/p>\n\t\t{{~else~}}\n\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t<p>{{#if in_single_private_channel~}}\n\t\t\t\t\t{{#t}}Channels organize your team's conversations by topic or working group. As a guest,{{\/t}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{~#if_equal total_count compare=1~}}\n\t\t\t\t\t\t{{#t first_listed_channel=(firstListedChannel)}}Channels organize your team's conversations by topic or working group. As a guest, you can send messages and browse archives in one channel, <strong>{first_listed_channel}<\/strong>.{{\/t}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{#t}}Channels organize your team's conversations by topic or working group. As a guest, you can send messages and browse archives in the channels listed here.{{\/t}}\n\t\t\t\t\t{{~\/if_equal~}}\n\t\t\t\t{{~\/if~}}\n\t\t\t\t{{~#unless in_single_private_channel~}}\n\t\t\t\t\t{{~#currentUserIsURA}}\n\t\t\t\t\t\t\t{{!-- Don't show anything --}}\n\t\t\t\t\t{{~else~}}\n\t\t\t\t\t\t{{!-- Don't show anything --}}\n\t\t\t\t\t{{~\/currentUserIsURA~}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{#t}}you can access one channel, <span class=\"no_wrap\"><ts-icon class=\"ts_icon_lock\"><\/ts-icon><strong>{first_group_channel_name}<\/strong><\/span>. This is a private, invitation-only channel.{{\/t}}\n\t\t\t\t{{~\/unless}}<\/p>\n\t\t\t{{~else~}}\n\t\t\t\t<p>{{#t}}Channels bring order and searchability to your team\u2019s conversations. They\u2019re organized by topic (#research), working group (#sales), or specific project (#sales-tv-ad).{{\/t}}<\/p>\n\t\t\t{{~\/currentUserIsRA~}}\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\t\t\n";
TS.raw_templates['intl_channel_names_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"intl_channel_names_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t{{#t}}\n\t\t<h2 class=\"black\">Your channels, your language<\/h2>\n\t\t<p>Here\u2019s a handy thing: channel names can now include characters from many more languages.<\/p>\n\t\t{{\/t}}\n\t<\/div>\n<\/div>\n";
