TS.raw_templates['direct_messages_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"direct_messages_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t}}Send direct messages{{\/t}}<\/h2>\n\t\t{{~#currentUserIsAdmin~}}\n\t\t\t<p>{{#t}}Need to send a quick note to just one person or a small group of people on your team? Direct messages are great for that!{{\/t}}<\/p>\n\t\t{{~else~}}\n\t\t\t<p>{{#t}}Need to send a quick note to just one person or a small group of people on your team?{{\/t}}\n\t\t\t{{~#currentUserIsRA~}}\n\t\t\t\t{{~#if_equal channels_count compare=0}}\n\t\t\t\t\t{{#t}}You can send direct messages to anyone in the same channel as you.{{\/t}}\n\t\t\t\t{{~else~}}\n\t\t\t\t\t{{~#if_gt groups_count compare=0}}\n\t\t\t\t\t\t{{#t}}You can directly message anyone in the same channels or groups as you.{{\/t}}\n\t\t\t\t\t{{~else}}\n\t\t\t\t\t\t{{#t}}You can directly message anyone in the same {channels_count, plural, =1 {channel} other {channels}} as you.{{\/t}}\n\t\t\t\t\t{{~\/if_gt~}}\n\t\t\t\t{{~\/if_equal~}}\n\t\t\t{{~else}}\n\t\t\t\t{{#t}}Direct messages are great for that.{{\/t}}\n\t\t\t{{~\/currentUserIsRA~}}\n\t\t\t<\/p>\n\t\t{{~\/currentUserIsAdmin~}}\n\t<\/div>\n<\/div>\n";
TS.raw_templates['highlights_feedback_coachmark'] = "{{i18n_ns 'highlights_coachmark'}}\n\n<div id=\"highlights_feedback_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"coachmark_contents\">\n\t\t<h2 class=\"black\">{{#t}}Fine-tune your highlights{{\/t}}<\/h2>\n\t\t<p>{{#t}}When a highlight\u2019s especially helpful (or not), leave a little feedback and Slack will adjust.{{\/t}}<\/p>\n\t<\/div>\n<\/div>\n";
TS.raw_templates['recent_mentions_coachmark'] = "{{i18n_ns \"coachmarks\"}}\n\n<div id=\"recent_mentions_coachmark_div\" class=\"coachmark_div\">\n\t<div class=\"small_coachmark_contents\">\n\t\t<span>{{#t}}<strong class=\"black\">Click<\/strong> to learn more about @ mentions.{{\/t}}<\/span>\n\t<\/div>\n\t<div class=\"coachmark_contents\">\n\t\t{{#t}}\n\t\t<h2 class=\"black\">All your @ mentions in one place<\/h2>\n\t\t<p>Anytime someone mentions your name or any of your highlight words, the message will be listed here.<\/p>\n\t\t{{\/t}}\n\t<\/div>\n<\/div>\n";
