TS.raw_templates['channel_page_notif_prefs'] = "{{i18n_ns \"channel_pages\"}}\n\n{{#unless is_muted}}\n\t<div class=\"channel_desktop_notifs small_bottom_margin\">\n\t\t<div class=\"greigh mini {{#channelInsightsIsEnabled}}black small_bottom_margin{{else}}bold{{\/channelInsightsIsEnabled}}\">{{#t}}Desktop notifications{{\/t}}<\/div>\n\t\t{{#if desktop_notifs_enabled}}\n\t\t\t{{#if desktop_everything}}{{#t}}All new messages{{\/t}}{{\/if}}\n\t\t\t{{#if desktop_mentions}}{{#t}}Mentions &amp; keywords{{\/t}}{{\/if}}\n\t\t\t{{#if desktop_nothing}}{{#t}}Nothing{{\/t}}{{\/if}}\n\t\t{{else}}\n\t\t\t<p class=\"highlight_yellow_bg\">\n\t\t\t\t{{#if notifications_not_yet_allowed}}\n\t\t\t\t\t<span>{{#t}}You have not yet allowed desktop notifications. Open the <button onclick=\"TS.ui.prefs_dialog.start('notifications')\" class=\"preference_dialog_btn cursor_pointer bold btn_link\" type=\"button\">Preferences Dialog<\/button> and follow the instructions to set them up.{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if notifications_not_allowed}}\n\t\t\t\t\t<span>{{#t}}You\u2019ve disallowed notifications in your browser. You\u2019ll need to open your browser preferences to change that.{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t\t{{#if notifications_impossible}}\n\t\t\t\t\t<span>{{#t}}Your browser does not support desktop notifications. <a href=\"\/downloads\" target=\"_blank\">Try one of our apps?<\/a>{{\/t}}<\/span>\n\t\t\t\t{{\/if}}\n\t\t\t<\/p>\n\t\t{{\/if}}\n\t<\/div>\n\t<div class=\"channel_push_notifs bottom_margin\">\n\t\t<div class=\"greigh mini {{#channelInsightsIsEnabled}}black small_bottom_margin{{else}}bold{{\/channelInsightsIsEnabled}}\">{{#t}}Mobile notifications{{\/t}}<\/div>\n\t\t\t{{#if push_everything}}{{#t}}All new messages{{\/t}}{{\/if}}\n\t\t\t{{#if push_mentions}}{{#t}}Mentions &amp; keywords{{\/t}}{{\/if}}\n\t\t\t{{#if push_nothing}}{{#t}}Nothing{{\/t}}{{\/if}}\n\t<\/div>\n{{\/unless}}\n{{#if is_muted}}\n\t<div class=\"bold bottom_margin\">\n\t\t{{#if model_ob.is_channel}}\n\t\t\t{{#t}}This channel is muted{{\/t}}\n\t\t{{else}}\n\t\t\t{{#if model_ob.is_mpim}}\n\t\t\t\t{{#t}}This conversation is muted{{\/t}}\n\t\t\t{{else}}\n\t\t\t\t{{#t}}This channel is muted{{\/t}}\n\t\t\t{{\/if}}\n\t\t{{\/if}}\n\t<\/div>\n{{\/if}}\n<button class=\"edit_notif_prefs_btn btn btn_small btn_outline\">{{#t}}Edit preferences{{\/t}}<\/button>\n";
