TS.raw_templates['mpim_conversion_modal'] = "{{i18n_ns \"mpims\"}}\n\n{{#if_gt uras.length compare=0}}\n\t<div id=\"ura_alert\" class=\"alert alert_warning\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t\t{{#t ura_list=(listify (getDisplayNames uras) strong=true no_escape=true)}}\n\t\t\t\t{ura_list} { uras.length, plural, =1 { is a Single-Channel Guest. They are already a member } other { are Single-Channel Guests. They are already members }} of one channel, and will not have access to this new private channel.\n\t\t\t{{\/t}}\n\t<\/div>\n{{\/if_gt}}\n<div id=\"confirmation_step\" class=\"channel_modal\">\n\t<h1 class=\"large_bottom_margin channel_modal_header\">\n\t\t{{#t}}Are you sure?{{\/t}}\n\t<\/h1>\n\t<p>{{#t}}By converting this conversation to a private channel, you will make the entire message history and all shared files visible to the new members that you invite to the channel.{{\/t}}<\/p>\n\t<button type=\"button\" class=\"btn btn_outline dialog_cancel tiny_right_margin\">{{#t}}Cancel{{\/t}}<\/button>\n\t<button type=\"button\" class=\"btn btn_primary dialog_go continue\">{{#t}}Yes, continue{{\/t}}<\/button>\n<\/div>\n<div id=\"conversion_step\" class=\"hidden\">\n\t<h1 class=\"large_bottom_margin channel_modal_header\">\n\t\t{{#t}}Enter a name for the channel{{\/t}}\n\t<\/h1>\n\t<label for=\"channel_create_title\" class=\"\">{{#t}}Name{{\/t}}<\/label>\n\t<input\n\t\tid=\"channel_create_title\"\n\t\tname=\"title_input\"\n\t\ttype=\"text\"\n\t\tclass=\"lowercase title_input no_margin\"\n\t\tvalue=\"\"\n\t\tplaceholder=\"{{#t}}Enter name here{{\/t}}\"\n\t\tdata-validation=\"channel_name=fix\"\n\t\tdata-validation-for=\"channel_create_title\"\n\t\tdata-validation-success=\"\"\n\t\tautocapitalize=\"off\"\n\t\tautocorrect=\"off\"\n\t\tautocomplete=\"off\"\n\t>\n\t<span class=\"modal_input_note margin_auto\">\n\t\t{{#t}}Names must be lowercase, without spaces or periods, and shorter than 22 characters.{{\/t}}\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden name_taken_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}That name has been taken. Try something different.{{\/t}}\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden invalid_chars_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}You entered some disallowed characters in the name, which we've fixed. Make sure it looks good to you, and try again!{{\/t}}\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden single_punctuation_warning margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t{{#t}}Sorry! Names cannot be a single hyphen or underscore.{{\/t}}\n\t<\/span>\n\t<span class=\"modal_input_note mustard_yellow hidden other_error margin_auto block\">\n\t\t<i class=\"ts_icon ts_icon_warning\"><\/i>\n\t\t<span class=\"error_message\"><\/span>\n\t<\/span>\n\t<p class=\"large_top_margin\">\n\t\t{{#t member_list=(listify (getDisplayNames members) strong=true no_escape=true)}}\n\t\t\tYou are about to convert the group DM with {member_list} to a private channel. <strong>This cannot be undone.<\/strong>\n\t\t{{\/t}}\n\t<\/p>\n\t<button type=\"button\" class=\"btn btn_outline dialog_cancel tiny_right_margin\">{{#t}}Cancel{{\/t}}<\/button>\n\t<button type=\"button\" class=\"btn btn_primary convert_mpim_go ladda-button\" data-style=\"expand-right\"><span class=\"ladda-label\">{{#t}}Convert to a private channel{{\/t}}<\/span><\/button>\n<\/div>";
