TS.raw_templates['sli_expert_search_results'] = "{{i18n_ns \"search\"}}\n\n<div class=\"search_module_header position_relative\">\n\t<p>{{#t}}People &amp; Channels{{\/t}} <a class=\"sli_expert_search__debug normal tiny\" href=\"http:\/\/slack.com\/god\/search_experts_terms.php?terms={{terms}}&grouped=1\">{{#if debug}}{{#t}}debug{{\/t}}{{\/if}}<\/a><\/p>\n<\/div>\n<div class=\"sli_expert_search {{#unless expanded}}sli_expert_search--collapsed{{\/unless}}\" data-js=\"sli_expert_search\">\n\t<div class=\"sli_expert_search_cta\" data-js=\"sli_expert_search_cta\">\n\t\t{{!-- this becomes hidden when the results expand --}}\n\t\t<div class=\"sli_expert_search_cta__face_pile\" data-js=\"sli_expert_search_toggle\">\n\t\t\t<div class=\"sli_expert_search_cta__faces position_relative\">\n\t\t\t\t{{~#each users~}}\n\t\t\t\t\t{{~makeMemberPreviewLinkImage this 24~}}\n\t\t\t\t\t{{~#and @last ..\/show_plus_sign_on_last_face~}}\n\t\t\t\t\t\t<div class=\"sli_expert_search__plus_sign_overlay align_center\">\n\t\t\t\t\t\t\t<ts-icon class=\"ts_icon_plus_thick\"><\/ts-icon>\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t{{~\/and~}}\n\t\t\t\t{{~\/each~}}\n\t\t\t<\/div>\n\t\t\t<div class=\"sli_expert_search_cta__text small overflow_ellipsis\">{{#t}}<strong class=\"black\">{user_count, plural, =1 {# person} other {# people}}<\/strong> {user_count, plural, =1 {talks} other {talk}} about this\u2026{{\/t}}<\/div>\n\t\t\t<ts-icon class=\"ts_icon_caret_right sli_expert_search__arrow\"><\/ts-icon>\n\t\t<\/div>\n\n\t\t{{!-- this is hidden on first render --}}\n\t\t<div class=\"sli_expert_search_header small\" data-js=\"sli_expert_search_toggle\">\n\t\t\t<span class=\"sli_expert_search_header__title\">{{#t}}People who talk about <strong class=\"black\">{query}<\/strong>{{\/t}}<\/span>\n\t\t\t<ts-icon class=\"ts_icon_caret_down sli_expert_search__arrow\"><\/ts-icon>\n\t\t<\/div>\n\t<\/div>\n\n\t{{!-- this is hidden on first render --}}\n\t<div class=\"sli_expert_search__results\">\n\t\t{{#each results}}\n\t\t<div class=\"sli_expert_search__result\" data-expert-search-group-index=\"{{@index}}\" data-expert-search-module-name=\"experts\">\n\t\t\t<div class=\"display_flex\">\n\t\t\t\t<div class=\"sli_expert_search__faces\">\n\t\t\t\t\t{{#if_equal this.faces.length compare=2}}\n\t\t\t\t\t\t<div class=\"sli_expert_search__bg_face\">{{makeMemberPreviewLinkImage this.faces.[1] 24}}<\/div>\n\t\t\t\t\t\t<div class=\"sli_expert_search__fg_face\">{{makeMemberPreviewLinkImage this.faces.[0] 24}}<\/div>\n\t\t\t\t\t{{else}}\n\t\t\t\t\t\t<div class=\"sli_expert_search__face\">{{makeMemberPreviewLinkImage this.faces.[0] 36}}<\/div>\n\t\t\t\t\t{{\/if_equal}}\n\t\t\t\t<\/div>\n\t\t\t\t<div class=\"sli_expert_search__description\">\n\t\t\t\t\t{{dangerouslyRenderHTML this.description}}\n\t\t\t\t\t{{#if this.partial_terms}}\n\t\t\t\t\t\t<div class=\"sli_expert_search__partial_terms\">\n\t\t\t\t\t\t\t{{#each this.terms}}\n\t\t\t\t\t\t\t\t{{#if this.present}}<span>{{word}}<\/span>{{else}} <s><span>{{word}}<\/span><\/s>{{\/if}}\n\t\t\t\t\t\t\t{{\/each}}\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t{{\/if}}\n\t\t\t\t<\/div>\n\t\t\t<\/div>\n\t\t<\/div>\n\t\t{{\/each}}\n\t\t{{#each channel_matches}}\n\t\t<div class=\"sli_expert_search__result\" data-expert-search-group-index=\"{{..\/results.length}}\" data-expert-search-module-name=\"channels\">\n\t\t\t<div class=\"small\">{{#t note=\"TS-only prototype\"channels=this.channels}}Also discussed in {channels}{{\/t}}<\/div>\n\t\t<\/div>\n\t\t{{\/each}}\n\t<\/div>\n<\/div>";
TS.raw_templates['sli_search_facets_results'] = "{{!-- hbslint-disable unwrapped --}}\n{{!-- This template is for internal use and won't be shown to users in anything resembling the curent form --}}\n\n<div class=\"search_facets_results\">\n    <div class=\"search_module_header position_relative\">\n        <p>Facet Suggestions<\/p>\n    <\/div>\n    {{#if channel_names }}\n        <div id=\"sli_search_facets_channel\" class=\"search_module\" data-js=\"sli_search_facets__channel_facets\">\n            <span class=\"sli_search_facets_channel__title\"><strong class=\"black\">Try in these channels:<\/strong><\/span>\n            {{#each channel_names}}\n                <span style=\"white-space: nowrap\" class=\"sli_search_facets_channel__channel_names\">#{{this}}{{#unless @last}},{{\/unless}}<\/span>\n            {{\/each}}\n        <\/div>\n        <br>\n    {{\/if}}\n    {{#if user_names }}\n        <div id=\"sli_search_facets_channel\" class=\"search_module\" data-js=\"sli_search_facets__channel_facets\">\n            <span class=\"sli_search_facets_channel__title\"><strong class=\"black\">Try from these users:<\/strong><\/span>\n            {{#each user_names}}\n                <span style=\"white-space: nowrap\" class=\"sli_search_facets_channel__user_names\">@{{this}}{{#unless @last}},{{\/unless}}<\/span>\n            {{\/each}}\n        <\/div>\n        <br>\n    {{\/if}}\n<\/div>\n\n";
TS.raw_templates['app_space'] = "{{i18n_ns \"app_space\"}}\n\n<ul class=\"navigation\">\n\t<li class=\"featured_apps_link\">{{#t}}Featured Apps{{\/t}}<\/li>\n\t<li class=\"your_apps_link active\">{{#t}}Your Apps{{\/t}}<\/li>\n\t<li class=\"build_apps_link\">{{#t}}Build your own{{\/t}}<\/li>\n<\/ul>\n<div class=\"content\">\n\t<div class=\"apps featured_apps display_none\">{{#t}}Here you'll find the Featured Apps{{\/t}}<\/div>\n\t<div class=\"apps your_apps display_flex\"><\/div>\n\t<div class=\"apps build_apps display_none\">{{#t}}Here you can learn how to Build Apps{{\/t}}<\/div>\n<\/div>\n<div class=\"footer small\"><a href=\"https:\/\/www.slack.com\/apps\" class=\"subtle_silver\">{{#t}}Browse the App Directory {{\/t}}<ts-icon class=\"ts_icon_external_link_square\"><\/ts-icon><\/a><\/div>";
TS.raw_templates['app_space_alternative_view'] = "{{i18n_ns \"app_space\"}}\n<div class=\"app_space_alternative_view_wrapper\">\n\t<div class=\"app_space_alternative_view_content\">\n\t\t<span class=\"app_space_alternative_view_emoji\">{{emoji}}<\/span>\n\t\t{{#if is_error}}\n\t\t\t<div class=\"app_space_alternative_view_message align_center\">{{#t}}Something\u2019s fishy! Slack can\u2019t seem to load your apps. <br\/> You can try again, but if the problem persists, please <a href=\"https:\/\/slack.com\/help\/contact\">drop us a line.<\/a>{{\/t}}<\/div>\n\t\t\t<button type=\"button\" class=\"btn app_space_error_state_refresh_button\">{{#t}}Try Again{{\/t}}<\/button>\n\t\t{{else is_empty}}\n\t\t\t<div class=\"app_space_alternative_view_message align_center\">\n\t\t\t\t{{#feature flag=\"feature_teams_to_workspaces\"}}\n\t\t\t\t\t{{#t}}\n\t\t\t\t\t\t<p class=\"app_space_empty_state_message_header\">You have no apps installed.<\/p>\n\t\t\t\t\t\t<p>Apps installed on your workspace will be collected right here. <br\/> <a href=\"\" target=\"_blank\">Learn about apps<\/a><\/p>\n\t\t\t\t\t{{\/t}}\n\t\t\t\t{{else}}\n\t\t\t\t\t{{#t}}\n\t\t\t\t\t\t<p class=\"app_space_empty_state_message_header\">You have no apps installed.<\/p>\n\t\t\t\t\t\t<p>Apps installed on your team in will be collected right here. <br\/> <a href=\"\" target=\"_blank\">Learn about apps<\/a><\/p>\n\t\t\t\t\t{{\/t}}\n\t\t\t\t{{\/feature}}\n\t\t\t<\/div>\n\t\t{{\/if}}\n\t<\/div>\n<\/div>";
TS.raw_templates['app_space_app_card'] = "<div class=\"app_card flex_third display_flex align_items_center height_60 featured_category_app\" data-app-id=\"{{app_id}}\">\n\t<img class=\"app_card_icon rounded\"\n\t\t{{#if icons}}\n\t\t\tsrc=\"{{icons.image_64}}\"\n\t\t{{else}}\n\t\t\tsrc=\"{{versioned_default_application_icon}}\"\n\t\t{{\/if}}\n\t>\n\t<div class=\"small_padding indifferent_grey inline_block overflow_ellipsis\">\n\t\t<div class=\"app_name small overflow_ellipsis\">{{name}}<\/div>\n\t\t<div class=\"app_category light overflow_ellipsis\">{{category}}<\/div>\n\t<\/div>\n<\/div>";
