TS.raw_templates['app_space_channel_header'] = "{{i18n_ns \"channel_header\"}}\n{{!--\n\t## Channel header tabs\n\tCurrently used only when viewing a DM with an App\/Bot user\n --}}\n<div class=\"channel_header__tabs\" data-js=\"channel_header_tabs\">\n\n\t<button\n\t\ttype=\"button\"\n\t\tclass=\"btn_unstyle channel_header__tab --active\"\n\t\tdata-action=\"toggleAppSpaceView\"\n\t\tdata-target=\"messages\"\n\t>\n\t\t{{#t}}Messages{{\/t}}\n\t<\/button>\n\n\t<button\n\t\ttype=\"button\"\n\t\tclass=\"btn_unstyle channel_header__tab\"\n\t\tdata-action=\"toggleAppSpaceView\"\n\t\tdata-target=\"about\"\n\t>\n\t\t{{#t}}About{{\/t}}\n\t<\/button>\n\n\t{{#feature flag=\"feature_app_space_permissions_tab\"}}\n\t\t<button\n\t\t\ttype=\"button\"\n\t\t\tclass=\"btn_unstyle channel_header__tab hidden\"\n\t\t\tdata-action=\"toggleAppSpaceView\"\n\t\t\tdata-target=\"permissions\"\n\t\t>\n\t\t\t{{#t}}Permissions{{\/t}}\n\t\t<\/button>\n\t{{\/feature}}\n\n<\/div>";
TS.raw_templates['shared_invites_modal'] = "{{i18n_ns 'invites'}}\n<div id=\"shared_invite_link_modal\">\n\t<div id=\"shared_invite_link_modal_header\">\n\t\t<div id=\"shared_invite_modal_link_title\">{{#t}}Share your team\u2019s invite link{{\/t}}<\/div>\n\t\t<div class=\"shared_invite_link_description\">{{#t}}Anyone can use this link to join your Slack team.{{\/t}}<\/div>\n\t<\/div>\n\n\t<div id=\"shared_invite_link_modal_body\"><\/div>\n\n\t<div id=\"shared_invite_link_modal_footer\">\n\t\t<a class=\"link_btn no_underline\" data-action=\"shared_invite_open_email_invites\"><ts-icon class=\"ts_icon_envelope_o subtle_silver align_bottom small_right_margin\"><\/ts-icon>{{#t}}Invite people by email...{{\/t}}<\/a>\n\t<\/div>\n<\/div>\n\n";
TS.raw_templates['shared_invites_modal_admin_create_link_body'] = "{{i18n_ns 'invites'}}\n<div id=\"select_shared_invite_expiration_container\">\n\t<select name=\"select_shared_invite_expiration\" id=\"select_shared_invite_expiration\" class=\"small\">\n\t{{#t note=\"the amount of time before their shared invite link expires\"}}\n\t\t<option value=\"1\">Expires in 1 day<\/option>\n\t\t<option value=\"7\">Expires in 7 days<\/option>\n\t\t<option selected=\"selected\" value=\"30\">Expires in 30 days<\/option>\n\t\t<option value=\"365000\">Never expires<\/option>\n\t{{\/t}}\n\t<\/select>\n<\/div>\n<button type=\"button\" class=\"btn full_width ladda-button\" data-action=\"shared_invite_create_link\" data-style=\"expand-right\">{{#t}}<span class=\"ladda-label\">Create Invite Link{{\/t}}<\/span><\/button>";
TS.raw_templates['shared_invites_modal_warning'] = "{{i18n_ns 'invites'}}\n\n{{#if_equal warning compare=\"link_disabled\"}}\n\t<div id=\"shared_invite_link_modal_warning\">\n\t\t<ts-icon class=\"ts_icon ts_icon_info_circle inline_block align_top candy_red\"><\/ts-icon>\n\t\t<div class=\"inline_block\">\n\t\t\t<div class=\"candy_red bold very_small_bottom_margin\">{{#t}}Your link has been deactivated{{\/t}}<\/div>\n\t\t\t<div class=\"small subtle_silver\">{{#t}}If you'd like, you can create a new one.{{\/t}}<\/div>\n\t\t<\/div>\n \t<\/div>\n{{else if_equal warning compare=\"ratelimited\"}}\n\t<div id=\"shared_invite_link_modal_warning\">\n\t\t<ts-icon class=\"ts_icon ts_icon_info_circle inline_block align_top candy_red\"><\/ts-icon>\n\t\t<div class=\"inline_block\">\n\t\t\t<div class=\"candy_red bold tiny_bottom_margin\">{{#t}}You're creating links too fast!{{\/t}}<\/div>\n\t\t\t<div class=\"small subtle_silver\">{{#t}}Try again in a few minutes, please.{{\/t}}<\/div>\n\t\t<\/div>\n\t<\/div>\n{{\/if_equal}}\n";
TS.raw_templates['shared_invites_modal_share_link_body'] = "{{i18n_ns 'invites'}}\n<div class=\"shared_invite_modal_link_input_container\">\n\t<input type=\"text\" id=\"shared_invite_link_url\" class=\"shared_invite_link_input small\" value=\"{{shared_invite_url}}\" data-invite-url=\"{{shared_invite_url}}\" readonly onclick=\"this.select();\">\n\t<a id=\"shared_invite_modal_link_copy_btn\" class=\"shared_invite_link_copy_btn btn ts_tip ts_tip_top hide_copy_btn_ts_tip\" role=\"btn\" data-action=\"copy_shared_link\" data-clog-click=\"true\" data-clog-event=\"INVITE_SHARED_CLICK\" data-clog-params=\"action=copy_shared_invite_link,trigger=click_copy_btn\">\n\t\t<span class=\"ts_tip_btn\">{{#t}}Copy{{\/t}}<\/span>\n\t\t<span class=\"ts_tip_tip\">{{#t}}Invite link copied!{{\/t}}<\/span>\n\t<\/a>\n<\/div>\n\n<div class=\"shared_invite_modal_expiration small_top_margin small\">\n\t{{#if time_until_expiration_string}}\n\t<a class=\"link_btn bold no_underline ts_tip ts_tip_top ts_tip_left\" role=\"button\" disabled=\"disabled\">\n\t\t<span class=\"ts_tip_btn\">\n\t\t\t{{#t expiration_string=time_until_expiration_string}}Expires {expiration_string}.{{\/t}}\n\t\t<\/span>\n\t\t<span class=\"ts_tip_tip ts_tip_multiline\">{{#t expiration_date=expiration_date expiration_time=expiration_time}}This link will expire on<br>{expiration_date} at {expiration_time}{{\/t}}<\/span>\n\t<\/a>\n\t{{else}}\n\t\t<span class=\"bold\">{{#t}}This link doesn't expire.{{\/t}}<\/span>\n\t{{\/if}}\n\t{{#if is_admin}}\n\t\t{{#t}}Need to change this? Deactivate your link and choose a new duration. <a class=\"candy_red underline link_btn\" role=\"button\" data-action=\"disable_shared_link\"><nobr>Deactivate link<\/nobr><\/a>{{\/t}}\n\t{{\/if}}\n<\/div>\n";
TS.raw_templates['apps_browser'] = "{{i18n_ns \"apps_browser\"}}\n\n<div class=\"links_container\">\n\t<a class=\"manage_apps_link\" href=\"\/apps\/manage\" data-manage_apps_link>\n\t\t<ts-icon class=\"ts_icon_cog_o\"><\/ts-icon>{{#t}}Manage apps...{{\/t}}\n\t<\/a>\n\t<a class=\"view_tutorial_link {{#unless showTutorial}}display_none{{\/unless}}\" data-view_tutorial_link>\n\t\t<ts-icon class=\"ts_icon_lightbulb_o\"><\/ts-icon>{{#t}}What are apps?{{\/t}}\n\t<\/a>\n<\/div>\n<div id=\"apps_browser_container\"><\/div>\n";
TS.raw_templates['card_carousel'] = "{{i18n_ns \"card_carousel\"}}\n\n<div class=\"c-card_carousel__image_section\">\n\t<div>\n\t\t{{#if allow_animations }}\n\t\t\t{{#if card.animation }}\n\t\t\t\t<img src=\"{{card.animation}}\"><\/img>\n\t\t\t{{else}}\n\t\t\t\t<img src=\"{{card.image}}\"><\/img>\n\t\t\t{{\/if}}\n\t\t{{else}}\n\t\t\t<img src=\"{{card.image}}\"><\/img>\n\t\t{{\/if}}\n\t<\/div>\n<\/div>\n<div class=\"c-card_carousel__text_section\">\n\t<div>\n\t\t<p class=\"bold\">{{card.title}}<\/p>\n\t\t<p>{{card.text}}<\/p>\n\t<\/div>\n<\/div>";
TS.raw_templates['card_carousel_buttons'] = "{{i18n_ns \"card_carousel_buttons\"}}\n\n\t<div class=\"c-card_carousel__btn_container\"><p class=\"c-card_carousel__page_count\">{{#t}}{display_card_index} of {number_of_cards}{{\/t}}<\/p><\/div>\n\n\t{{#unless first_card}}\n\t\t<div class=\"c-card_carousel__btn_container\">\n\t\t\t<a class=\"c-card_carousel__btn c-card_carousel__btn--left\" data-card_left_button>\n\t\t\t\t<i class=\"ts_icon ts_icon_arrow_large_left\"><\/i>\n\t\t\t<\/a>\n\t\t<\/div>\n\t{{\/unless}}\n\n\t<div class=\"c-card_carousel__btn_container\">\n\t\t<a class=\"c-card_carousel__btn c-card_carousel__btn--right\" data-card_right_button>\n\t\t\t<i class=\"ts_icon ts_icon_arrow_large_right\"><\/i>\n\t\t<\/a>\n\t<\/div>\n\n\t{{#if last_card }}\n\t\t<div class=\"c-card_carousel__btn_container\">\n\t\t\t<a class=\"c-card_carousel__btn c-card_carousel__btn--close\" data-card_close_button>\n\t\t\t\t<i class=\"ts_icon ts_icon_check_large\"><\/i>\n\t\t\t<\/a>\n\t\t<\/div>\n\t{{\/if}}";
TS.raw_templates['quick_promo_invite_nudge'] = "{{i18n_ns \"dialogs_quick_promo\"}}\n<button type=\"button\" class=\"close c-modal_close--quick_promo\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;<\/button>\n<div class=\"c-modal_graphic_wrapper--quick_promo\">\n\t<img class=\"c-modal_graphic--quick_promo\" src=\"{{versioned_ill_team '2x'}}\" srcset=\"{{versioned_ill_team '1x'}} 1x, {{versioned_ill_team '2x'}} 2x\" alt=\"{{#t}}An illustration of a friendly bunch of coworkers.{{\/t}}\"\/>\n<\/div>\n<h3 class=\"c-modal_copy_header--quick_promo\">\n\t{{#if copy_is_contextual_with_invites}}\n\t\t{{#t}}See what Slack can do \u2014 invite more teammates!{{\/t}}\n\t{{else}}\n\t\t{{#t}}See what Slack can do \u2014 invite your teammates!{{\/t}}\n\t{{\/if}}\n<\/h3>\n<p class=\"c-modal_copy--quick_promo\">\n\t{{#if copy_is_non_contextual}}\n\t\t{{#t}}Bring your teammates into Slack, so you can cut down on reply-all emails and start working together more efficiently.{{\/t}}\n\t{{else if copy_is_contextual_with_invites}}\n\t\t{{#t}}\n\t\t\tSo far, you\u2019ve invited {invite_count, plural, =1{# person}other{# people}} to this team. Bring more of your teammates into Slack, so you can cut down on reply-all emails and start working together more efficiently.\n\t\t{{\/t}}\n\t{{else}}\n\t\t{{#t invite_count=invite_count}}\n\t\t\tSo far, you haven\u2019t invited anyone to this team. Bring your teammates into Slack, so you can cut down on reply-all emails and start working together more efficiently.\n\t\t{{\/t}}\n\t{{\/if}}\n<\/p>\n";
