TS.raw_templates['admin_cant_deactivate_modal'] = "{{i18n_ns \"cant_deactivate_modal\"}}\n\n<span class=\"modal-header-image modal-header-image--oops\"><\/span>\n<h3>{{#t}}Can\u2018t remove {full_member_name}{{\/t}}<\/h3>\n<p>{{#t group_list=(listify groups strong=true)}}{full_member_name} is part of {groups.length, plural, =1{# group}other{# groups}} assigned to this team: {group_list}.{{\/t}}<\/p>\n<p>{{#t}}To remove {member_name}, an Org Admin must either remove them from the groups in {idp_label}, or unassign the groups from {team_name}.{{\/t}}<\/p>\n";
TS.raw_templates['admin_cancel_survey_dialog'] = "{{i18n_ns \"admin_billing_item\"}}\n\n{{#feature flag=\"feature_cancel_survey\"}}\n\t<label class=\"normal large_bottom_margin\">{{#t note='Prompt for users who just downgraded from a paid to unpaid plan'}}If you have a moment, we would love to know why you decided to switch to the free plan.{{\/t}}<\/label>\n\n\t<form action=\"\" id=\"admin_cancel_survey\" name=\"admin_cancel_survey\">\n\t\t<textarea maxlength=\"500\" placeholder=\"{{#t note='Placeholder text for a form asking why users downgraded from a paid to unpaid plan'}}We switched because...{{\/t}}\"><\/textarea>\n\t<\/form>\n{{\/feature}}";
