TS.raw_templates['api_channel_picker_row'] = "{{i18n_ns \"api\"}}\n\n{{#if item.is_group}}\n\t{{#if item.is_mpim}}\n\t\t<i class=\"ts_icon multipary_dm_icon ts_icon_multiparty_dm_{{item.members.length}}\"><\/i>{{item.name}}\n\t{{else}}\n\t\t<i class=\"ts_icon ts_icon_lock\"><\/i>{{item.name}}\n\t{{\/if}}\n{{else}}\n\t{{#if item.is_channel}}\n\t\t<i class=\"ts_icon ts_icon_channel\"><\/i>{{item.name}}\n\t{{else}}\n\t\t{{item.icon}}{{#if item.member.is_self}}{{#t}}{item.name} (you){{\/t}}{{else}}{{item.name}}\n\t{{\/if}}\n\t{{\/if}}\n{{\/if}}\n";
